INSERT INTO `homework` (`LessonID`, `Question`, `Data`, `Count`) VALUES
	(6, '[{"Question":"商代的龍冠鳳紋珮是用來做什麼的？","Answers":["與神靈溝通","掛在身上的裝飾","保平安的辟邪物",""]},{"Question":"玉唅和玉握豬，分別雕成蟬和豬的造型，是用來做什麼的？","Answers":["掛在身上的裝飾  ","插花用的花器","陪葬的喪葬器",""]},{"Question":"哪一種玉器反映出北方鮮卑、女真族春日獵鷹捕雁的習俗？ ","Answers":["玉鳳凰","玉大雁帶飾","小玉鷹",""]},{"Question":"清代翠玉白菜上的螽蟴和蝗蟲，象徵什麼意義？","Answers":["豐衣足食","大富大貴 ","多子多孫",""]},{"Question":"清代的白玉鰲魚花插，是一件擺飾也可以用來插花，上面的鰲魚象徵什麼意義？","Answers":["科舉高中","招財進寶","早生貴子",""]},{"Question":"古人會雕哪一種想像出來的動物保平安？","Answers":["龍","鳳凰","辟邪",""]},{"Question":"清代的髮晶馬上封侯玉器，是用哪兩種動物來象徵即刻受封爵位做大官？","Answers":["馬、虎","馬、猴","龍、猴",""]},{"Question":"宋代人重視觀察寫生，可以從哪一類玉器反映出這種現象？","Answers":["黃玉鴨  ","小玉鷹","白玉春水飾件",""]}]', '[{"CorrectAnswer":0,"Description":"與神靈溝通"},{"CorrectAnswer":2,"Description":"陪葬的喪葬器"},{"CorrectAnswer":1,"Description":"玉大雁帶飾"},{"CorrectAnswer":0,"Description":"多子多孫\\n"},{"CorrectAnswer":0,"Description":"科舉高中\\n"},{"CorrectAnswer":2,"Description":"辟邪"},{"CorrectAnswer":0,"Description":"馬、猴"},{"CorrectAnswer":0,"Description":"黃玉鴨  "}]', 8),
	(7, '[{"Question":"畫家用來表現山石質感的筆法叫做？","Answers":["皴法","擦法","沾法",""]},{"Question":"哪一種山石景物的布局方式，可用來表現遼闊的景色？","Answers":["高遠","平遠","深遠",""]},{"Question":"元代趙孟頫的《鵲華秋色圖》，屬於哪一種畫幅型制？","Answers":["手卷","立軸","冊頁",""]},{"Question":"宋代馬遠的《山徑春行》，採用的是哪一種構圖，讓畫面呈現悠遠的意境？","Answers":["邊角式構圖","對稱式構圖","立體構圖",""]},{"Question":"哪一幅畫和宋代大文豪蘇東坡的詩意有關？","Answers":["宋代，郭熙《早春圖》 ","宋代，馬麟《秉燭夜遊》","元代，趙孟頫《鵲華秋色圖》 ",""]},{"Question":"故宮的鎮館寶之一《谿山行旅圖》，是五代末北宋初范寬的作品。畫家採用哪一種觀察角度，在畫面上呈現豐富的景物，讓觀者可以神遊其中？","Answers":["透視角度","俯瞰視角  ","移動視角",""]},{"Question":"哪一個朝代的文人，特別會藉由山水畫來表達希望遺世獨立、不願歸順朝廷的心情？","Answers":["宋代","元代 ","清代 ",""]},{"Question":"畫家不刻意勾勒線條，只用簡單幾筆畫出花鳥等形體特徵，是屬於哪一種畫法？","Answers":["沒骨畫法","工筆畫法 ","描摹畫法",""]}]', '[{"CorrectAnswer":0,"Description":"皴法"},{"CorrectAnswer":1,"Description":"平遠"},{"CorrectAnswer":0,"Description":"手卷\\n"},{"CorrectAnswer":0,"Description":"邊角式構圖"},{"CorrectAnswer":1,"Description":"宋代，馬麟《秉燭夜遊》"},{"CorrectAnswer":2,"Description":"移動視角"},{"CorrectAnswer":1,"Description":"元代 "},{"CorrectAnswer":0,"Description":"沒骨畫法"}]', 8),
	(8, '[{"Question":"古代的寫實風情畫從哪一個朝代開始？","Answers":["宋","元","清",""]},{"Question":"古代的貨郎類似現代哪一種行業？","Answers":["美容中心","雜貨商行 ","洗衣店",""]},{"Question":"在各式各樣的貨郎圖當中，可以發現哪一種情緒的人最多？","Answers":["生氣","悲傷","歡樂",""]},{"Question":"南宋的《市擔嬰戲》，是哪一位畫家的作品？","Answers":["李嵩","丁觀鵬","蘇漢臣",""]},{"Question":"下列哪一幅作品和古代貨郎圖一樣也是屬於寫實風俗畫？","Answers":["宋代，《清明上河圖》","宋代，馬麟《秉燭夜遊》","元代，趙孟頫《鵲華秋色圖》",""]},{"Question":"寫實風俗畫的出現，代表當時人們普遍的生活情況是？","Answers":["貧困","浪費","富裕",""]},{"Question":"下列描述哪一個不是寫實風俗畫的特色？","Answers":["極為精細的工筆描繪","用減筆法表達意境","以當時民眾生活樣貌為主題",""]},{"Question":"在古代貨郎圖當中，出現最多的人物是？","Answers":["孩童","婦女","老年人",""]}]', '[{"CorrectAnswer":0,"Description":"宋"},{"CorrectAnswer":1,"Description":"雜貨商行 "},{"CorrectAnswer":2,"Description":"歡樂"},{"CorrectAnswer":0,"Description":"李嵩"},{"CorrectAnswer":0,"Description":"宋代，《清明上河圖》"},{"CorrectAnswer":2,"Description":"富裕"},{"CorrectAnswer":1,"Description":"用減筆法表達意境"},{"CorrectAnswer":0,"Description":"孩童"}]', 8),
