	(12, '[{"Question":"唐代的三彩馬球仕女俑，主要有哪三種釉色？","Answers":["綠、乳白、褐","黑、金、紅","黃、銀、紫","綠、紅、藍"]},{"Question":"以下哪一個文物被清乾隆皇帝選上一起入畫？","Answers":["明萬曆時期，五彩百鹿尊","明宣德時期，刻花蓮瓣滷壺","西周晚期，毛公鼎","東漢，玉辟邪"]},{"Question":"明萬曆時期的五彩百鹿尊，其中的「鹿」，代表什麼吉祥意義？","Answers":["快樂","長壽","平安","幸福"]},{"Question":"西周晚期的毛公鼎，是為了什麼原因而做的","Answers":["當成傳家之寶 ","用來煮東西 ","用來種花","用來儲水"]},{"Question":"清18世紀的太平有象瓷尊，象背上扛的寶瓶，代表什麼吉祥意義？","Answers":["長壽","太平無事","富貴","豐收"]},{"Question":"東漢玉辟邪下方有一個木底座，是哪一位皇帝加上去的？","Answers":["明太祖","清乾隆","清康熙","秦始皇"]},{"Question":"明宣德時期的刻花蓮瓣滷壺，上面的紅色釉色，是哪一種成分經過氧化還原燒的方法燒製而成？","Answers":["銅","金","銀","錫"]},{"Question":"摶泥幻化中的「摶」，其讀音以及代表什麼意思呢？","Answers":["ㄓㄨㄢ，專門展示泥土製成的陶瓷","ㄅㄛˊ，代表陶瓷器需要很多知識","ㄊㄨㄢˊ，將泥土和在一起","ㄔㄨㄢˊ，表示泥土變陶瓷有很多傳奇故事"]}]', '[{"CorrectAnswer":0,"Description":"綠、乳白、褐"},{"CorrectAnswer":1,"Description":"明宣德時期，刻花蓮瓣滷壺"},{"CorrectAnswer":1,"Description":"長壽"},{"CorrectAnswer":0,"Description":"當成傳家之寶 "},{"CorrectAnswer":1,"Description":"太平無事"},{"CorrectAnswer":1,"Description":"清乾隆"},{"CorrectAnswer":0,"Description":"銅"},{"CorrectAnswer":2,"Description":"ㄊㄨㄢˊ，將泥土和在一起"}]', 8),
	(13, '[{"Question":"哪一種文書不是由皇帝頒佈的？","Answers":["詔書","上諭","誥命","奏摺"]},{"Question":"以下哪個情況皇帝會頒佈詔書，讓天下人都知道？","Answers":["出宮","生日","親政","皇子誕生"]},{"Question":"皇帝會在行政命令文書上的什麼地方，蓋上漢滿文玉璽？","Answers":["封面","日期","簽名處","第一行字起頭"]},{"Question":"皇帝詔書上的漢滿文玉璽上刻的文字內容是？","Answers":["皇帝手書","皇命浩蕩","皇帝用印","皇帝之寶"]},{"Question":"皇帝如果要下達上諭，會先交由哪一個單位處理？","Answers":["軍機處","內閣","內務府","慎刑司"]},{"Question":"誥命的封面及四周會有什麼圖樣？","Answers":["錦繡","鳳紋","龍紋","玉璽"]},{"Question":"大臣有事要向皇上稟報，所寫的文書屬於哪一種行政文書？","Answers":["詔書","上諭","誥命","奏摺"]},{"Question":"「知道了」是皇帝批閱大臣奏摺之後，經常會在上面寫的文字，皇帝想表達的意思是？","Answers":["朕已知道，上朝時不用再稟報","朕已知道，朝廷上再討論","朕已收到，但仍須再詳細說明","朕已知道，朕不同意"]}]', '[{"CorrectAnswer":3,"Description":"奏摺"},{"CorrectAnswer":2,"Description":"親政"},{"CorrectAnswer":1,"Description":"日期"},{"CorrectAnswer":3,"Description":"皇帝之寶"},{"CorrectAnswer":0,"Description":"軍機處"},{"CorrectAnswer":2,"Description":"龍紋"},{"CorrectAnswer":3,"Description":"奏摺"},{"CorrectAnswer":0,"Description":"朕已知道，上朝時不用再稟報"}]', 8),
	(14, '[{"Question":"欣賞書法有幾個不同的重點，不包括以下哪一項？","Answers":["點畫","造型","運筆","行氣"]},{"Question":"宋代蘇軾的《赤壁賦》書法作品，是屬於哪一種書體？","Answers":["隸書","草書","行書","楷書"]},{"Question":"我們在練習書法所用的「描紅」，以及古代大臣寫奏摺所用的字體，是哪一種書體？","Answers":["隸書","草書","行書","楷書"]},{"Question":"行書兼具楷書的規矩，以及草書的奔放，是古代許多名家喜歡用的書體，以下哪一個作品不是行書？","Answers":["東晉，王羲之《快雪時晴帖》","宋代，黃庭堅《花氣薰人帖》","東晉，王羲之《蘭亭集序》","唐代，歐陽詢《九成宮醴泉銘》"]},{"Question":"唐代懷素的《自敘帖》，有「天下第一草書」之稱，這件書法的欣賞重點是什麼？","Answers":["書寫的內容","飛舞靈動的筆法","工整的筆畫結構","每個字排列整齊"]},{"Question":"印刷術是相當古老的發明，因為有了印刷術，文字才能大量印製，文化才得以傳播得更廣。以下哪一種印刷方式最早出現？","Answers":["活字印刷","套版印刷","雕版印刷","網版印刷"]},{"Question":"哪一種方式比較接近現代的書籍裝訂方法？","Answers":["經摺裝","蝴蝶裝","卷軸","線裝"]},{"Question":"「成造木子」，意思是在印刷之前，先將棗木切割成許多小方塊，然後在每一個小方塊上刻一個字。這是哪一種印刷術的工序？","Answers":["活字印刷","套版印刷","雕版印刷","網版印刷"]}]', '[{"CorrectAnswer":1,"Description":"造型"},{"CorrectAnswer":2,"Description":"行書"},{"CorrectAnswer":3,"Description":"楷書"},{"CorrectAnswer":3,"Description":"唐代，歐陽詢《九成宮醴泉銘》"},{"CorrectAnswer":1,"Description":"飛舞靈動的筆法"},{"CorrectAnswer":2,"Description":"雕版印刷"},{"CorrectAnswer":3,"Description":"線裝"},{"CorrectAnswer":0,"Description":"活字印刷"}]', 8),
	(15, '[{"Question":"在陶瓷器上「開光」，指的是什麼意思？","Answers":["製作一可以開閤的小窗","雕刻鏤空透光的裝飾","局部打磨光亮","做出框線並在裡面加以裝飾"]},{"Question":"琺瑯彩在哪一個朝代達到最鼎盛、色彩最豐富？","Answers":["唐代","明代","元代 ","清代"]},{"Question":"清康熙年間的銅胎畫琺瑯菊花紋方壺，壺蓋上的鈕是菊花的哪一部分造型？","Answers":["花心","花蕊","花萼 ","花瓣"]},{"Question":"鼻煙壺顧名思義是用來裝鼻煙散的，清雍正皇帝年間，有一對分別是黑底及紅底的琺瑯彩鼻煙壺，上面畫了哪一種花？","Answers":["菊花","梅花","蘭花","荷花"]},{"Question":"清雍正年間的畫琺瑯竹節式鼻煙壺，它的本體是什麼材質？","Answers":["陶瓷 ","玻璃","竹子","銅"]},{"Question":"出現在古代文物上的蜘蛛裝飾，代表什麼意義？","Answers":["富貴吉祥","事事如意","喜從天降","珠圓玉潤"]},{"Question":"明永樂年間的青花纏枝花卉紋蓮花式盤，上面的「纏枝」類似藤蔓，它的作用是？","Answers":["將單獨的花卉圖案串連起來","填補空白的地方","增加圖樣的豐富性 ","以上皆是"]},{"Question":"明永樂年間的青花纏枝花卉紋蓮花式盤，最外圈的口沿部分盤繞的是哪一種紋飾？","Answers":["花卉","龍鳳","海水波濤","日月星辰"]}]', '[{"CorrectAnswer":3,"Description":"做出框線並在裡面加以裝飾"},{"CorrectAnswer":3,"Description":"清代"},{"CorrectAnswer":0,"Description":"花心"},{"CorrectAnswer":1,"Description":"梅花"},{"CorrectAnswer":1,"Description":"玻璃"},{"CorrectAnswer":2,"Description":"喜從天降"},{"CorrectAnswer":3,"Description":"以上皆是"},{"CorrectAnswer":2,"Description":"海水波濤"}]', 8),
	(16, '[{"Question":"從唐代的灰陶加彩仕女俑這件文物，可以知道當時流行什麼？","Answers":["豐腴的體態 ","貼身的衣服","長髮披肩 ","穿著涼鞋"]},{"Question":"唐人官樂圖這幅畫中的仕女，她們的化妝方式代表當時的審美觀，現在還可以在什麼樣的人身上看到？","Answers":["芭蕾舞者","西班牙舞者","京劇演員","日本藝技"]},{"Question":"北宋定窯白瓷嬰兒枕，深受哪一位皇帝喜愛，特別在底部題了一首《御製詩》？","Answers":["康熙","乾隆","雍正","光緒"]},{"Question":"翠玉白菜是清光緒帝的妃子瑾妃的嫁妝，上面有一隻螽斯和一隻蝗蟲，其中的螽斯代表什麼吉祥意義？","Answers":["萬壽無疆","多子多孫","歲歲平安","富貴吉祥"]},{"Question":"商晚期至西周早期的析子孫父乙扁足鼎，它的三支腳是鳳鳥造型，這是因為禽鳥對商代的人有什麼重要意義？","Answers":["始祖是禽鳥的後代","禽鳥曾經拯救人民","國家地形像一隻鳥","商王養了很多鳥"]},{"Question":"析子孫父乙扁足鼎上大眼圓睜的獸面紋，它是古人幻想出來的哪一種神獸？","Answers":["龍","饕餮 ","四不像","鳳凰"]},{"Question":"商晚期的蟠龍紋盤，是用來裝水洗手的盤子，它和哪一種類似水瓢的青銅器搭配使用？","Answers":["尊","甗","鼎","匜"]},{"Question":"西周晚期的人足獸鋬匜，它的哪一個地方是用正在飲水的小野獸造型設計？","Answers":["把手","四足","注水口","蓋子"]},{"Question":"戰國中期的嵌綠松石金屬絲犧尊，是一個類似犀牛造型的酒壺，壺蓋在它的什麼地方？","Answers":["肚子","嘴巴","背上","尾巴"]}]', '[{"CorrectAnswer":0,"Description":"豐腴的體態 "},{"CorrectAnswer":3,"Description":"日本藝技"},{"CorrectAnswer":1,"Description":"乾隆"},{"CorrectAnswer":1,"Description":"多子多孫"},{"CorrectAnswer":0,"Description":"始祖是禽鳥的後代"},{"CorrectAnswer":1,"Description":"饕餮 "},{"CorrectAnswer":3,"Description":"匜"},{"CorrectAnswer":0,"Description":"把手"},{"CorrectAnswer":2,"Description":"背上"}]', 9),
