	(18, '[{"Question":"古人的陪葬品叫做「冥器」，以下哪一件文物是冥器？","Answers":["清 翠玉白菜","東漢 褐釉陶犬","清 肉形石 ","宋至元 玉鴨"]},{"Question":"宋至元代的玉鴨藏品，是用哪一種礦石雕成的？","Answers":["輝玉","瑪瑙","水晶","閃玉"]},{"Question":"清代肉形石是故宮的明星展件之一，原本收藏在皇帝工作和休息的養心殿，怎麼知道皇帝特別喜愛它？","Answers":["底下特別加了漂亮的基座","複製了好幾個 ","上面刻了字","加了墜飾"]},{"Question":"清代19世紀廣東鏤雕雲龍套球，是利用什麼雕刻法從裡到外用象牙雕成的？","Answers":["陰刻","直角雕","陽刻","浮雕法"]},{"Question":"清珊瑚魁星點斗盆景，巧奪天工的工藝技法裡，運用了鳥類羽毛，這個技法叫做？","Answers":["點羽","羽飾","點翠","翠飾"]},{"Question":"清珊瑚魁星點斗盆景，當中的人物腳踩著魚頭，代表什麼吉祥意義？","Answers":["龍鳳呈祥","吉慶有餘","年年有餘","獨占鰲頭"]},{"Question":"清嘉靖年間的剔紅雲龍雕刻小櫃，是古代的多寶格，具有什麼功用？","Answers":["置放雕刻工具","收納珍玩","置放藥材","收納銀兩"]},{"Question":"清代的多寶格，是從明代哪一類文物演變而來？","Answers":["文具小櫃","醫藥箱","點心小櫃","書櫃"]}]', '[{"CorrectAnswer":1,"Description":"東漢 褐釉陶犬"},{"CorrectAnswer":3,"Description":"閃玉"},{"CorrectAnswer":0,"Description":"底下特別加了漂亮的基座"},{"CorrectAnswer":1,"Description":"直角雕"},{"CorrectAnswer":2,"Description":"點翠"},{"CorrectAnswer":3,"Description":"獨占鰲頭"},{"CorrectAnswer":1,"Description":"收納珍玩"},{"CorrectAnswer":0,"Description":"文具小櫃"}]', 8),
