INSERT INTO `lesson` (`LessonID`, `LessonCategoryID`, `LessonName`, `ImageUrl`, `VideoLength`, `LessonLength`, `Brief`, `Goal`, `Target`, `ChapterSubjects`, `HasChapterSubject`, `VisitCount`, `HasHomeWork`, `ChapterTitle`, `CreateTime`, `Active`, `IsDeleted`) VALUES
	(6, 2, '玉石百獸園', 'lesson/image/362b00e2-fbc6-40d3-a8a8-f7d1e3aa23a7.jpg', 7060, '58分50秒', '<p><span style="font-size:12pt">&nbsp;&nbsp;&nbsp; <span style="color:black">「玉」就是美麗的石頭，中國人自古以來就很喜歡玉，而且玉在中華文化中占有相當重要的分量，每一個朝代都有代表性的玉器。在各式各樣的玉器當中，許多都是以鳥獸、昆蟲等做為造型，像是在翠玉白菜上面，就躲著螽蟴和蝗蟲呢！</span></span></p>\n\n<p><span style="font-size:12pt">&nbsp;&nbsp;&nbsp; <span style="color:black">古人喜歡刻鳥獸和昆蟲，除了是取材身邊容易觀察的對象，其實還有更深一層的意義，有的可用來與神靈溝通，是做為祭祀的禮器；有的則是用來避邪，或具有祝福的吉祥含意。此外，所雕刻的動物也不一定都是真實的，例如龍和鳳凰等，就是想像出來的祥獸。</span></span></p>\n\n<p><span style="font-size:12pt">&nbsp;&nbsp;&nbsp; <span style="color:black">欣賞美麗的古代玉器，同時也可以了解各種鳥獸在古人心目中的象徵意義，是不是很有趣呢！</span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><b><span style="background:#fefefe"><span style="color:#0070c0">想知道嗎？</span></span></b></span></p>\n\n<ol>\n	<li><span style="font-size:12pt"><span style="background:#fefefe">玉石是哪一種石頭？為什麼古人特別喜歡它？</span></span></li>\n	<li><span style="font-size:12pt"><span style="background:#fefefe">玉石雕琢成玉器，除了裝飾之外，還有哪些用途呢？</span></span></li>\n	<li><span style="font-size:12pt"><span style="background:#fefefe">玉器上常見的鳥獸和昆蟲，代表什麼意義？</span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">透過動畫虛擬角色，以提問方式帶出相關知識，可讓大眾對玉器有概括了解。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">挑選具代表性的典藏做為範例深入欣賞，可加深印象。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">局部放大玉器細節，加上動畫特效，幫助學習欣賞。</span></span></span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對中國</span></span></span><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">玉器</span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">有興趣的青少年、成年人</span></span></span></span></span></p>\n', NULL, b'0', 7443, b'1', '故宮遊藝思', '2021-11-26 16:08:24', b'0', b'0'),
	(7, 2, '走進文人畫的世界', 'lesson/image/ab417c5b-2b65-4881-9de2-c73af4118552.jpg', 3423, '57分03分', '<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe"><span style="color:black">在文字出現以前，人類就會畫畫了，最早的繪畫出現在上萬年前的原始洞窟壁面上，是做為記事之用。經過漫長時間的發展，中西方各有不同的繪畫特色。中國畫最大的特色是「書畫同源」，書法和繪畫的源流相同，書法也是一種繪畫；另一個特色則是「文人畫」。</span></span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt">&nbsp;&nbsp;&nbsp; <span style="background:#fefefe"><span style="color:black">「文人畫」一詞是明代董其昌提出的，他推崇唐代王維為始祖，光看這個字面就可以知道指的是文人所畫的畫，沒錯！文人就是讀書人，他們將繪畫、詩文、</span></span><span style="color:black">篆刻一起引入畫面，</span><span style="background:#fefefe"><span style="color:black">不同於宮廷畫和民間畫，</span></span><span style="color:black">在世界人類繪畫史上也是絕無僅有。</span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt">&nbsp;&nbsp;&nbsp; <span style="color:black">文人畫</span><span style="background:#fefefe"><span style="color:black">講究意境更甚於精準寫實的描繪，題材上大多為山水、花鳥，以及梅蘭竹菊等。他們畫在紙上或絹上的作品，經過時間長河保留到現在，雖然原本的色彩褪去，但筆墨的意境仍然呼之欲出。</span></span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt">&nbsp;&nbsp;&nbsp; <span style="background:#fefefe"><span style="color:black">我們應該如何欣賞、體會古代文人在畫中表達的境界呢？</span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="color:#2980b9;"><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><b><span style="background:#fefefe">想知道嗎？</span></b></span></span></span></p>\n\n<ol>\n	<li><span style="color:#2980b9;"><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe">站在一張古畫前面，我們應該從哪裡開始欣賞？</span></span></span></span></li>\n	<li><span style="color:#2980b9;"><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe">古人為什麼這麼喜歡畫花鳥？這些花鳥都是參考真實世界的嗎？</span></span></span></span></li>\n	<li><span style="color:#2980b9;"><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe">山水畫好像一首詩，你感受到了嗎？</span></span></span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="color:black">以</span><span style="background:#fefefe"><span style="color:black">動畫的方式，藉由虛擬角色進入古畫場景，與畫中人物或畫家對話，深入淺出、寓教於樂。</span></span></span></span></li>\n	<li><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe"><span style="color:black">挑選具代表性的典藏做為範例深入欣賞，可加深印象。</span></span></span></span></li>\n	<li><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="color:black">局部放大畫面細節，加上動畫特效，幫助學習欣賞。</span></span></span></li>\n</ol>\n\n<ol>\n</ol>\n', '<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe"><span style="color:black">國小學童</span></span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="background:#fefefe"><span style="color:black">對中國繪畫有興趣的青少年、成年人</span></span></span></span></p>\n', '[{"ID":1,"Name":"趙叔叔說畫時間"},{"ID":2,"Name":"另類的故事"},{"ID":3,"Name":"發現之旅－走進畫中的大自然"}]', b'1', 3397, b'1', '故宮遊藝思', '2021-11-26 16:26:32', b'0', b'0'),
	(8, 1, '貨郎來了，有糖吃的小孩最幸福─AI古人情緒辨識', 'lesson/image/c47985d0-09f7-41ab-8972-250d4043b8d2.jpg', 1266, '10分33秒', '<p><span style="font-size:12pt">哇！你看過會移動的雜貨店嗎？古代販賣雜貨的小販稱為「貨郎」，他們會挑著貨擔或獨輪車，滿載著各種日用品、玩具、胭脂水粉、農具、糖果、菜蔬等食物，手搖撥浪小鼓沿街叫賣，除了吸引婦女前來購買，小朋友們也都很開心，因為貨郎帶來的不只是商品，也是農村小鎮平淡生活的小確幸。</span></p>\n\n<p><span style="font-size:12pt">我們可以從宋元明清留傳下來的各式貨郎圖，看見當時人們的生活樣貌，也可以透過大人、小孩們臉上的表情，看見貨郎受歡迎的程度。對了！大家有沒有發現，這些貨郎圖都畫<span style="font-size:16px;">得非常精細，這就是寫實風俗畫的特色之一，這類型的繪畫風格從宋代開始流行，畫家連人物的臉部表情也都描繪得栩栩如生，讓生活在現代的我們，還可以利用高科技的AI情緒辨識系統，來辨別古畫人物的情緒。</span></span></p>\n\n<p><span style="font-size:16px;">&nbsp; &nbsp; 你以自己的直覺解讀這些人物的情緒是開心、驚訝，還是平靜？AI情緒辨識系統分辨出來的結果又是如何呢？一起來玩吧！</span></p>\n\n<p><span style="font-size:16px;"><strong>想知道嗎？</strong></span></p>\n\n<ol>\n	<li><span style="font-size:16px;">古代貨郎在做什麼？為什麼需要這樣的人物呢？</span></li>\n	<li><span style="font-size:16px;">想知道古人的日用品、小朋友的玩具長什麼模樣嗎？</span></li>\n	<li><span style="font-size:16px;">在古代，大家看見貨郎時會有什麼樣的心情？</span></li>\n</ol>\n', '', '', NULL, b'0', 1004, b'1', '故宮遊藝思', '2021-11-28 09:50:28', b'0', b'0'),
	(10, 1, '故宮文物猜猜看─AI聊天機器人來出題', 'lesson/image/73d3a452-3b1f-4a72-baab-b7aa9064e59f.jpg', 1186, '19分46秒', '<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:0,&quot;335559685&quot;:360,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:10,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{19}" paraid="0" xml:lang="EN-US"><span style="font-size:16px;"><span style="font-family:Arial,Helvetica,sans-serif;">透過與聊天機器人的對談，了解歷史文物的年代、特徵以及相關背景內容。以猜謎形式進行，提升學生學習動機。</span></span></p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:1,&quot;335559685&quot;:720,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:5,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{22}" paraid="0" xml:lang="EN-US">&nbsp;</p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:0,&quot;335559685&quot;:360,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:10,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{51}" paraid="0" xml:lang="EN-US"><span style="font-size:16px;"><span style="font-family:Arial,Helvetica,sans-serif;">【AI技術說明​】</span></span></p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:1,&quot;335559685&quot;:720,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:5,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{54}" paraid="0" xml:lang="EN-US"><span style="font-size:16px;"><span style="font-family:Arial,Helvetica,sans-serif;">使用雲端平台與自然語言處理技術，建構聊天機器人​</span></span></p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:1,&quot;335559685&quot;:720,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:5,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{54}" paraid="0" xml:lang="EN-US">&nbsp;</p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:0,&quot;335559685&quot;:360,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:10,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{57}" paraid="0" xml:lang="EN-US"><span style="font-size:16px;"><span style="font-family:Arial,Helvetica,sans-serif;">【使用教材​】</span></span></p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:1,&quot;335559685&quot;:720,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:5,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{60}" paraid="0" xml:lang="EN-US"><span style="font-size:16px;"><span style="font-family:Arial,Helvetica,sans-serif;">硬體：手機或電腦​</span></span></p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:1,&quot;335559685&quot;:720,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:5,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{63}" paraid="0" xml:lang="EN-US"><span style="font-size:16px;"><span style="font-family:Arial,Helvetica,sans-serif;">軟體：Line</span></span></p>\n\n<p data-ccp-props="{&quot;335551550&quot;:1,&quot;335551620&quot;:1,&quot;335559683&quot;:1,&quot;335559685&quot;:720,&quot;335559731&quot;:-360,&quot;335559737&quot;:0,&quot;335562764&quot;:2,&quot;335562765&quot;:1.2,&quot;335562766&quot;:4,&quot;335562767&quot;:5,&quot;335562768&quot;:4,&quot;335562769&quot;:0}" lang="EN-US" paraeid="{ff8818db-9c84-4013-87fc-c25ec8f9a86b}{63}" paraid="0" xml:lang="EN-US">&nbsp;</p>\n', '<ol>\n	<li>透過與聊天機器人對話過程給予的提示，認識故宮館藏中極具代表性之12件歷史文物，並熟記每件文物的特徵。</li>\n	<li>培養文物鑑賞之素養，從不同文物的製作風格，回推其年代之社會風氣。</li>\n</ol>\n', '<p><span style="font-size:16px;">國小四年級~國中九年級學生</span></p>\n', 'null', b'0', 1154, b'0', '故宮文物猜猜看', '2021-12-10 16:30:48', b'1', b'0'),
	(11, 1, '給你顏色瞧瞧', 'lesson/image/ec0c6ef0-ee6a-4734-88a6-7a02163123a0.jpg', 765, '', '<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:11.0pt">運用博物館史料，一窺唐宋妝容特色，進一步了解當時的美感及社會文化，並且透過科技載具，重現及體會唐代的妝容。</span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><b><span style="font-size:11.0pt">教學概念：</span></b></span></span></p>\n\n<p style="margin-left:17px; text-indent:-12.55pt"><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span lang="EN-US" style="font-size:11.0pt">1.</span><span style="font-size:11.0pt">從唐宋的妝容了解當時的美感及社會文化。 </span></span></span></p>\n\n<p style="margin-left:17px; text-indent:-12.55pt"><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span lang="EN-US" style="font-size:11.0pt">2.</span><span style="font-size:11.0pt">運用博物館史料，一窺唐宋的妝容特色。 </span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span lang="EN-US" style="font-size:11.0pt">3.</span><span style="font-size:11.0pt">以唐代妝容為例，透過科技載具，重現及體會唐代的妝容。</span></span></span></p>\n', '<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span lang="EN-US" style="font-size:11.0pt">1.</span><span style="font-size:11.0pt">學生能分辨唐宋的妝容並欣賞(認知)。 </span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span lang="EN-US" style="font-size:11.0pt">2.</span><span style="font-size:11.0pt">學生能理解唐宋的族群與社會文化關聯(認知、情意)。 </span></span></span></p>\n\n<p><span style="font-family:Arial,Helvetica,sans-serif;"><span lang="EN-US" style="font-size:11.0pt">3.</span><span style="font-size:11.0pt">學生透過科技模擬唐代妝容(技能)。</span></span></p>\n', '<p><span style="font-family:Arial,Helvetica,sans-serif;"><span style="font-size:12pt"><span style="font-size:11.0pt">適用年段：K5-9</span></span></span></p>\n', 'null', b'0', 844, b'0', '教學影片', '2021-12-20 18:41:10', b'1', b'0'),
	(12, 2, '文物知識大挑戰', 'lesson/image/2d7ea3bf-53da-467c-97fe-fb2e89cdb395.jpg', 797, '', '<p>在故宮裡，有許多美麗的藏品，其中包括各式各樣的生活器皿，但這些器皿跟我們一般在家裡用的很不一樣，它們更像是精緻的藝術品。</p>\n\n<p>這些都是皇帝珍愛的收藏，不一定會拿來使用；當然，在眾多的收藏品當中，還有更多是純粹觀賞的擺飾。不論是生活用品還是擺飾，這些精品有的是以釉色著稱，有的帶有吉祥象徵，都令皇帝愛不釋手呢！</p>\n\n<p>由於皇宮裡有專門製作精品的匠師和製造廠，所以才有這麼多在一般民間看不到的精品，快一起來大飽眼福吧！</p>\n\n<p>&nbsp;</p>\n\n<h2><span style="color:#3498db;">想知道嗎？</span></h2>\n\n<ol>\n	<li><strong><span style="color:#3498db;">故宮典藏了哪些皇帝最愛的珍品，該怎麼欣賞呢？</span></strong></li>\n	<li><strong><span style="color:#3498db;">皇宮裡的精品，有哪些吉祥的意義？</span></strong></li>\n	<li><strong><span style="color:#3498db;">從精品上的哪些小細節，可以知道皇帝珍愛的程度？</span></strong></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="color:black">導覽老師在實景現場解說，</span><span style="background:#fefefe"><span style="color:black">了解如何欣賞皇宮裡的珍品。</span></span></span></li>\n	<li><span style="font-size:12pt"><span style="background:#fefefe"><span style="color:black">挑選具代表性的典藏做為範例深入欣賞，可加深印象。</span></span></span></li>\n	<li><span style="font-size:12pt"><span style="color:black">影片中穿插小人物插畫，點出欣賞重點。</span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對文物及其蘊含意義有興趣的青少年、成年人</span></span></span></span></span></p>\n', 'null', b'0', 4294, b'1', '故宮遊藝思', '2022-06-08 11:45:56', b'1', b'0'),
	(13, 2, '皇宮裡的行政文書', 'lesson/image/060543f1-6ca6-4440-8bfa-80c0eff4fe74.jpg', 1132, '', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">「奉天承運皇帝，詔曰」，如果你有看過清宮的影視劇，一定經常會聽到當太監在傳達皇帝的詔書內容時，都會先唸這一句話，意思是皇帝受了上天的旨意，有事情要宣佈給大家知道，也就是「朕有旨意要發佈」。</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;<span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">在真實的皇宮裡的確是如此，皇帝要掌管這麼大的天下，以前沒有電子通訊設備，交通也不像現在這麼便利，除了大事必須頒佈詔書來傳達，還有各項行政命令，以及與大臣之間的溝通文書，都得靠驛站來傳遞。這些文書的內容，都是攸關國家的大事，有的可以向大眾公開，有的只能讓特定人士知道，非常機密，所以皇宮裡還有專門掌管的單位及存檔的地方呢！</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;<span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">那麼這些皇宮裡的文書，是不是有統一的格式和規定？而看起來似乎很嚴肅的文書，其實也穿插著許多有趣的小故事，快一起來看看吧！</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">想知道嗎？</span></span></span></b></span></span></p>\n\n<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">皇帝在什麼時候需要頒</span></span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#4f81bd">佈</span></span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">召告天下的行政命令？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">皇宮裡的文書，和一般的書法文物有什麼不同？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">大臣寫給皇帝的文書，通常都是什麼內容？皇帝會怎麼回覆呢？</span></span></span></span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">以</span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">動畫的呈現方式，藉由古代場景的虛擬角色互動，了解皇宮裡的行政命令與文書溝通等相關知識。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">挑選具代表性的典藏做為範例深入欣賞，可加深印象。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">局部放大文物細節，加上動畫特效，幫助學習欣賞。</span></span></span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對皇宮行政文書有興趣的青少年、成年人</span></span></span></span></span></p>\n', 'null', b'0', 1369, b'1', '五阿哥他爹的秘密治國武器', '2022-06-08 12:10:00', b'1', b'0'),
	(14, 2, '漢字的異想世界', 'lesson/image/822a7416-330a-4527-a12a-0a1be479b7b3.jpg', 2378, '', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">古人說：「書畫同源」，意思是書法和繪畫一樣，都是藝術作品。漢字成為一項書寫的藝術，可以說是世界上絕無僅有的藝術表現方式。</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">書法的歷史非常久遠，回溯到中國古代最早的書寫方式，當時沒有毛筆，是用刀刻在金石上，後來古人發明了筆、墨、紙、硯，歷代都出現許多書法造詣極高的名家。他們的作品流傳至今，許多時候，我們甚至不用看懂每一個字，就可以從筆畫之間，感受到書法家想要傳達的意境和韻味。</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">古人除了將文字發展成書寫的藝術以外，為了能將書寫的內容傳播得更廣、更遠，發明了印刷術，以及將一頁一頁印了文字的紙裝訂成書的方法，並經過多次改良，呈現出許多不同的樣貌。</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">以前沒有方便的通信設備，書籍就是傳遞知識的唯一方式，從這些不同樣貌的書本當中，也可以看到古代文明智慧的演進歷程。</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">想知道嗎？</span></span></span></b></span></span></p>\n\n<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">每一位名家寫的書法字都不一樣，我們應該怎麼欣賞？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">書法有哪幾種字體？這些字體是怎麼演變出來的？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">書本為什麼是長這個樣子？古代的書籍有幾種型式？</span></span></span></span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">以</span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">動畫的呈現方式，藉由古代場景虛擬角色的互動，深入淺出，了解書法與古代印刷裝訂等相關知識。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">挑選具代表性的典藏做為範例深入欣賞，可加深印象。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">局部放大畫面細節，加上動畫特效，幫助學習欣賞。</span></span></span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對書法及古代書籍裝訂有興趣的青少年、成年人</span></span></span></span></span></p>\n', '[{"ID":1,"Name":"五阿哥的書法探奇"},{"ID":2,"Name":"五阿哥的異想世界"}]', b'1', 2699, b'1', '漢字的異想世界', '2022-06-08 14:28:50', b'1', b'0'),
	(15, 2, '我的故宮花園', 'lesson/image/928b7152-8c01-40ba-9a2a-ed82d24a8a2c.jpg', 2014, '', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;&nbsp;&nbsp; <span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">你發現了嗎？故宮外面有美麗的庭院，種植著各種不同的花花草草；而在典藏文物的建築物裡，也有一座美不勝收的花園，豐富多彩的花卉，就盛開在古人的器物上，它們流傳了好幾百年，到現在仍然繽紛美麗，讓人忍不住多看一眼。</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;&nbsp;&nbsp; <span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">在各式各樣的文物當中，用</span></span></span><span style="background:white"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black"><span style="letter-spacing:.45pt">琺瑯彩裝飾的器物，</span></span></span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">花葉紋飾的色彩最豐富。什麼是</span></span></span><span style="background:white"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black"><span style="letter-spacing:.45pt">琺瑯彩呢？簡單的說，它是透過高溫燒結，在玻璃、金屬或陶瓷器物的表面，包覆一層玻璃或陶瓷外殼，並利用繁複的工藝，製作出各種色彩的花葉圖案。</span></span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;&nbsp;&nbsp; <span style="background:white"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black"><span style="letter-spacing:.45pt">古代曾經讓歐洲人大為驚豔的青花瓷，上面也有許多精緻的花卉圖樣，相較於色彩斑斕的琺瑯彩，青花瓷的青色花葉優美典雅，呈現出另一種不同的美，一起來欣賞！</span></span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">想知道嗎？</span></span></span></span></span></p>\n\n<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">哪些文物上有美麗的花葉紋裝飾？哪些花卉比較常見？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">文物上的花卉造型，和真實的花卉有什麼不同？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">我們也可以學古人畫花，該怎麼下筆呢？</span></span></span></span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">從製作一本小書，到學習用簡單線條畫出文物上的花卉，享受創作樂趣。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">觀察文物上的花葉紋，進而再深入認識這件文物的其他相關知識</span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">局部放大文物細節，有身臨其境的效果，彷彿與文物面對面觀察欣賞。</span></span></span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對文物花草紋飾有興趣的青少年、成年人</span></span></span></span></span></p>\n', 'null', b'0', 1352, b'1', '我的故宮花園小書', '2022-09-05 14:35:10', b'0', b'0'),
	(16, 2, '來找文物的「眼睛」', 'lesson/image/272c6358-8b11-4e1c-9afc-b6fd08fc8f08.jpg', 897, '', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">&nbsp;故宮的寶貝這麼多，來到這裡一定要張大眼睛仔細看喔！對了，很多文物也有「眼睛」，它們可都是故宮裡的明星，你有看到嗎？</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;&nbsp;&nbsp; <span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">這些明星當然少不了丰姿綽約的仕女、可愛的小嬰兒，還有很多青銅器上面的神獸。青銅器是距今兩、三千年前商周時代的文物，大都是各種鍋碗瓢盆，以現代人的眼光來看，用銅來鑄造這些生活器皿，會不會太重、太不好用了？這是因為當時能利用的材料很有限，銅是很貴重的金屬，當然也只有王室貴族才能使用。而青銅器上面的神獸，有的很可愛，有的大眼圓睜，反映出當時人們對於未知的自然萬物，充滿了崇拜和敬畏的心情。</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;&nbsp;&nbsp; <span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">想像一下，這些青銅器當年沒有被風化鏽蝕，像黃金一樣亮澄澄的樣子，上面的神獸是不是又更閃亮了。</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">想知道嗎？</span></span></span></span></span></p>\n\n<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">一千多年前的化妝術，和現在有什麼不同？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">哪些文物以人物或動物做造型，皇帝最喜歡哪一個？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">為什麼古人喜歡幻想真實世界看不到的神獸？</span></span></span></span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">以生動的人物和動物為主題，欣賞並深入了解文物的故事。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">透過導覽員現場解說，有如身臨其境從不同角度欣賞文物</span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">局部放大文物細節，加上動畫及小人物穿插點綴加強重點知識。</span></span></span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對文物有興趣的青少年、成年人</span></span></span></span></span></p>\n', 'null', b'0', 3174, b'1', '故宮遊藝思', '2022-09-05 17:41:06', b'0', b'0'),
	(18, 2, '皇帝的玩具箱', 'lesson/image/d7bed7aa-3a8f-43fe-b67d-c48d21bfe4ac.jpg', 910, '', '<p><span style="font-size:12pt"><span style="background:white"><span style="font-family:Calibri,sans-serif"><span style="background:white"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#222222">對，沒有錯！皇帝也有玩具箱，故宮的藏品都是清朝皇帝的收藏，有一些雖然體積不大，但可以拿在手上把玩，也可以放在案頭上欣賞，例如維妙維肖的玉鴨和肉形石，透過人為染色及加工，就和真的一樣；另外，還有工藝精湛繁複的盆景，以及多達二十幾層的鏤雕套球，皇帝拿在手上邊玩邊欣賞，在處理繁重的國家大事之餘，可以暫時放鬆身心。</span></span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="background:white"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#222222">為了收納小巧玲瓏的寶貝，皇帝還特別請工匠製作多寶格，也就是類似小朋友的玩具箱，不同的是，多寶格還兼具展示架的功能，而且就連多寶格本身也是精雕細琢的精品，真是令人歎為觀止。</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="background:white"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#222222">故宮裡還有一些很特別的典藏，是古人的陪葬品，叫做「冥器」，它們也都是逝去的人生前喜歡的物品。</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="background:white"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#222222">參觀這些曾經被人愛不釋手的文物，想想看，你是不是也有很喜歡的物品，你都怎麼對待它們呢？</span></span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:12pt"><span style="background:white"><span style="font-family:Calibri,sans-serif">&nbsp; &nbsp;</span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:#0070c0">想知道嗎？</span></span></span></span></span></p>\n\n<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">什麼樣的文物可以讓皇帝拿在手上把玩？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">故宮裡有哪些小巧精緻的藏品，怎麼欣賞呢？</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">古人的陪葬品都是生前喜歡的物品嗎？</span></span></span></span></span></li>\n</ol>\n', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">以小巧精緻的典藏為主題，欣賞並深入了解文物的故事。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">透過導覽員現場解說，有如身臨其境從不同角度欣賞文物</span></span><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">。</span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">局部放大文物細節，加上動畫及小人物穿插點綴加強重點知識。</span></span></span></span></li>\n</ol>\n', '<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">國小學童</span></span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="background:#fefefe"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">對文物有興趣的青少年、成年人</span></span></span></span></span></p>\n', 'null', b'0', 7589, b'1', '故宮遊藝思', '2022-09-06 15:21:14', b'1', b'0'),
	(19, 1, '跟著小翠穿越清明上河圖', 'lesson/image/cdbd699a-fd5a-4fc2-836e-808be00cca78.png', 2516, '', '<p style="text-align:justify; text-indent:24.0pt"><span style="font-size:11pt"><span style="text-justify:inter-ideograph"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">本教案是從「找威利」一書中得到靈感，希望藉由學生在尋找嵌入清明上河圖中的小翠時，同步仔細觀察清明上河圖中的人物、活動以及場景。過程中，除了更深入的了解文物的藝術價值以及背後的歷史知識之外，也能體驗到人工智慧為我們進行影像辨識時，所帶來的便利以及快速，並對於相關技術背後的原理有基本的認識，也知道這樣的技術在生活中有哪些應用。</span></span></span></span></span></span></span></span></p>\n\n<p style="text-align:justify; text-indent:24.0pt">&nbsp;</p>\n\n<p style="text-align:justify"><span style="font-size:11pt"><span style="text-justify:inter-ideograph"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">課程AI</span></span></span></span><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">技術說明：</span></span></span></span></span></span></span></span></p>\n\n<p style="text-align:justify"><span style="font-size:11pt"><span style="text-justify:inter-ideograph"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">1. 使用</span></span></span></span><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">YOLOv4影像辨識的技術，先在清明上河圖中標記人物、動物或是守衛等等的角色，接著讓機器進行學習，建立辨識相關物件的模型。</span></span></span></span></span></span></span></span></p>\n\n<p style="text-align:justify"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">2. 使用</span></span></span></span><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">yolov4-custom-functions的功能，讀取</span></span></span></span><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">在前一步建立的YOLOv4模型，就可以即時辨識出在畫面中有多少目標資料。除了將目標（人物、動物或是守衛）的範圍匡出來之外，也可以即時顯示目標資料的數量。</span></span></span></span></p>\n', '<p>1. 認識清明上河圖</p>\n\n<p>2. 認識並運用人工智慧AI技術</p>\n', '<p>K3~K12</p>\n', 'null', b'0', 286, b'0', '教學影片', '2022-12-09 14:03:47', b'1', b'0'),
	(20, 1, '盤中悄然盛放：定窯', 'lesson/image/65d97cce-cfe2-44f8-ae27-5ae76d695e6b.jpg', 568, '', '<p>1. 以故宮博物院收藏之定窯瓷器做為課程素材，讓學生了解瓷器之於中國的歷史意義、中國瓷器的發展，以及曾作為御用瓷器的定窯的製作技法與特色。<br />\n2. 透過複製件（或照片）的觀察討論，以及橡皮手工雕刻和石膏模的製作體驗，了解定窯製作技法中的劃花與印花。<br />\n3. 透過分享與討論，思考手工製作與大量生產的相關議題</p>\n\n<p>&nbsp;</p>\n', '<p>1. 博物館文物學習主題目標：了解宋代定窯的相關歷史、技術、特色。<br />\n2. 藝術與科技的美感學習目標：認識藝術雕刻及工藝中的範鑄技法，並了解藝術與科技如何透過相互整合協作，精準轉譯文物內涵與創新應用。<br />\n3. 透過不同生產技法的認識與討論，思考相關生產議題。</p>\n', '<p>Ｋ5-Ｋ12</p>\n', 'null', b'0', 327, b'0', '教學影片', '2022-12-09 14:15:06', b'1', b'0'),
	(21, 1, '藍曬國寶風景', 'lesson/image/97bbbea1-8fbf-4c44-a69b-e130ccb65353.png', 994, '', '<p>1. 以故宮博物院鎮院國寶 〈萬壑松風〉、〈早春圖〉及〈谿山行旅〉為基底，讓學生了解這幾幅畫作的歷史背景、畫風、技術等文物知識 。<br />\n2. 透過透過「繪晤山水」線上網站為引導，結合對國寶畫作的理解，及國畫上基本構圖原則說明，重組畫作各個部件，成為自己的獨特畫作。https://theme.npm.edu.tw/exh110/Treasures/NPM_Puzzle/https://theme.npm.edu.tw/exh110/Treasures/NPM_Puzzle/<br />\n3. 利用藍曬技術將自己製作的山水畫作轉換為藍曬明信片。<br />\n4. 讓學生至校園收集自然素材，作為藍曬圖的基本材料，另外創作一幅創意藍曬山水畫作。<br />\n5. 透過分享，與同學分享自己創作的山水畫。</p>\n\n<p>&nbsp;</p>\n', '<p>1. 博物館文物學習主題目標：了解國寶畫作的相關歷史背景、畫風、技術。<br />\n2. 藝術與科技的美感學習目標：了解藝術與科技如何透過相互整合協作，精準轉譯文物內涵與創新應用。<br />\n3. 了解相關文物畫作的歷史背景、學會數位製圖及藍曬製圖操作，製作專屬自己的故宮山水藍曬畫作。</p>\n', '<p>Ｋ4~12</p>\n', 'null', b'0', 123, b'0', '教學影片', '2022-12-09 14:22:34', b'1', b'0'),
	(22, 1, '士拿乎的時尚風潮', 'lesson/image/f61f576b-5011-4456-b216-e2cdab9ec359.png', 0, '', '<p>1. 以故宮博物院「 士拿乎－清宮鼻煙壺的時尚風潮 」之策展主軸與展品做為課程引導初探各種材質之鼻煙壺，從雕刻、燒製、琢磨等工藝角度理解其製作及所呈現之時代特色，且以珍藏、日常到賞賜等不同目的，看到清代工藝之縮影，更是清宮微型藝術之精典。<br />\n2. 介紹鼻煙壺文物中常出現的圖案及樣態 ，讓學生創作屬於自己的圖案並繪製於玻璃瓶上 。<br />\n3. 透過分享，與同學分享自己的創作 。</p>\n', '<p>1. 博物館文物學習主題目標：了解鼻煙壺的相關歷史背景及技術。<br />\n2. 藝術與科技的美感學習目標：了解藝術與科技如何透過相互整合協作，精準轉譯文物內涵與創新應用。<br />\n3. 運用手繪、實體媒材、黏貼等方式，設計並製作屬於自己的鼻煙壺 。</p>\n', '', 'null', b'0', 113, b'0', '教學影片', '2022-12-09 14:30:18', b'1', b'0'),
	(23, 1, '刻石取拓：我的黑老虎', 'lesson/image/d8b2594f-6ef1-4e58-bec3-08ac1abdf5e3.png', 0, '', '<p>1. 以故宮博物院南部院區 「 刻石取拓─故宮碑帖特展 」之策展主軸與延伸展品做為課程引導同時利用教具模型，引導學生了解碑帖拓本作為一個古老的收藏類別及其文化意涵 。<br />\n2. 讓學生至校園探詢石碑、水溝蓋、銘碑等物件，並利用紙張、鉛筆嘗試拓印，體驗取拓的過程。<br />\n3. 引導學生創作圖案或文字，並透過雕刻石膏板創作屬於自己的圖案拓片 。<br />\n4. 教授拓印技巧，讓學生將自己創作的拓片轉印到紙張、布料等材料上。<br />\n5. 透過分享，與同學分享自己的拓印創作 。</p>\n', '<p>1. 博物館文物學習主題目標：了解石刻取拓相關歷史背景。<br />\n2. 藝術與科技的美感學習目標：了解藝術與科技如何透過相互整合協作，精準轉譯文物內涵與創新應用。<br />\n3. 運用手繪、實體媒材等方式，設計屬於自己的拓印創作 。</p>\n', '<p>Ｋ4~12</p>\n', 'null', b'0', 142, b'0', '教學影片', '2022-12-09 14:35:59', b'1', b'0'),
	(24, 1, '山花舞蝶：平衡童玩教育遊具', 'lesson/image/d4c88650-44db-496f-926d-6a3ef98451cc.png', 924, '', '<p><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">本教案以故宮「草蟲捉迷藏」特展為核心，結合童玩再創新為發想，透過引導，讓學員認識院藏草蟲的繪畫風格與技巧與蟲草在畫中的含意，並觀察畫卷中的昆蟲與植物種類與畫面的平衡。</span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">在展覽中包含多種蝶蛾、蜻蜓等昆蟲，更有花卉奇石等。透過帶領學員學習畫中的技巧與典故，並將平面的畫作，利用剪紙與平衡遊具的製作方式，變成立體的呈現形式。</span></span></span></span></span></span></span><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">讓學員從中設計出心中的蝴蝶，並學習物理重心的原理，經過配重的實驗，找出最佳的平衡與平衡點，最終完成一個可平衡有色彩的創作。</span></span></span></span></span></span></span></p>\n', '<p><span style="font-size:11pt"><span style="text-autospace:none"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">1. 透過認識故宮數位典藏系統，瞭解文物學習的管道與知識。</span></span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:11pt"><span style="text-autospace:none"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">2. 藉由認識各類畫冊瞭解其文化與背後所衍生的故事與意函。</span></span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">3. 透過彩繪讓學生展現各自的創意及動手做的協調能力。</span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">4. 透過實際操作，培養學生勇於發現問題並解決問題的能力。</span></span></span></span></p>\n', '<p><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">&nbsp;Ｋ5~Ｋ12</span></span></span></span></p>\n', 'null', b'0', 587, b'0', '教學影片', '2022-12-09 15:00:48', b'1', b'0'),
	(25, 1, '福祿平安：葫蘆點點名', 'lesson/image/ef0d9228-5411-4265-9be3-1690640f6885.png', 1384, '', '<p>&nbsp; &nbsp; &nbsp; &nbsp;葫蘆在華人文化中具有重要的意象與寓意，不論是在書畫或是器物都可以看到葫蘆的造型。之所以重要是因為葫蘆本身有多重的吉祥象徵意義，其中包含了從讀音、植物特性到造型都有了不同的意涵。如:葫蘆與「福祿」的諧音相同，以及它是一種綿延伸展的蔓藤植物且葫蘆內藏有許多種籽而有了「多子多孫」、「長久不絕」的引寓，葫蘆口小肚大可廣納四方財用以象徵財庫飽滿納財致福。<br />\n&nbsp; &nbsp; &nbsp; &nbsp;本次教案藉由院藏瓷器、漆器、玉器、金屬器、琺瑯器、玻璃器等各種類的葫蘆，說明葫蘆文化的人文意涵，透過多樣選材的瞭解院藏中葫蘆器形藏品的多樣性、套模葫蘆與葫蘆器的應用說明材質本身的可塑性與生活應用」並透過同題異材的型式，介紹常見的葫蘆創作主題如福祿大吉、多子多孫等。<br />\n&nbsp; &nbsp; &nbsp; &nbsp;實作中透過半開放性的立體卡片創作，學習華人文化中「借物傳情」的意涵，並在創作中嘗試將外形變化成自己喜歡的造型。</p>\n', '<p><span style="font-size:11pt"><span style="text-autospace:none"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">1. 透過故宮數位典藏系統與線上資源，瞭解文物學習的管道與知識。</span></span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:11pt"><span style="text-autospace:none"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">2. 藉由欣賞文物來瞭解院藏中葫蘆的意涵。</span></span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:11pt"><span style="text-autospace:none"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">3. 藉由不同形式的作品類型，展現藝術創作的多樣性。</span></span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:11pt"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">4. 透過實際製作立體卡片學習數學中角度的概念。</span></span></span></span></span></span></span></p>\n\n<p><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:&quot;新細明體&quot;,serif"><span style="color:black">5. 透過分享製作過程，學習表達能力。</span></span></span></span></p>\n', '<p>Ｋ5~Ｋ12</p>\n', 'null', b'0', 516, b'0', '教學影片', '2022-12-09 15:07:18', b'1', b'0'),
	(26, 1, '八段錦AI互動防疫健康操', 'lesson/image/096542e6-36cd-428f-942a-ac7d638638d4.png', 856, '', '<p>1. 藉由故宮博物院特展「壽而康」及「杏林春暖」，介紹故宮博物院鎮院典藏畫冊〈 八段錦 〉，原本收藏於清光緒帝瑾妃所居永和宮，提倡結合肢體動作和呼吸吐納的健體運動，了解其意義、動作、淵源等。<br />\n2. 依據〈 八段錦 〉的動作指引，並引導學生練習八段錦各個招式。<br />\n3. 介紹人工智慧領域及應用，及 AI視覺辨識原理及相關模組，由於巡迴課程時間有限，故本課程僅針對靜待姿勢進行訓練特徵，透過線上google teachable machine 訓練及紀錄各種如故宮圖冊中的八段錦的定點靜態姿勢特徵，建立姿勢辨識系統並下載訓練。</p>\n\n<p>4. 介紹Scratch線上程式編輯網站，並匯入 google teachable machine線上八段錦訓練結果，設計互動介面，完成八段錦姿勢識別之 AI防疫健康操互動介面。<br />\n5. 由熟悉八段錦的教師或助教帶領 學生練習八段錦，並由AI防疫健康操互動介面判斷定點靜態姿勢是否正確，系統給予相對應 的回應以調整其姿勢，加強學生記憶八段錦各個招式，常此以往達到強身健體的效果，同時瞭解及學習中國既有傳統武學。<br />\n6. 與其他組別同學分享自己創作的互動介面，並練習及測試AI防疫健康操。</p>\n', '<p>1. 博物館文物學習主題目標：了解相關文物歷史背景。<br />\n2. 新興科技技術學習目標 ：AI視覺 、姿勢辨識、語音播放。<br />\n3. 藝術與科技的美感學習目標：了解藝術與科技如何透過相互整合協作精準轉譯文物內涵並利用姿勢辨識、語音引導等新興科技進行創 新應用。</p>\n', '<p>Ｋ4~12</p>\n', 'null', b'0', 833, b'0', '教學影片', '2022-12-16 14:34:18', b'1', b'0'),
