	(36, 2, '貨郎來了，有糖吃的小孩最幸福-AI古人情緒辨識', '國立中央大學-鐘祥仁、吳昌儒', 'X', 'K4-9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n運用AI人臉辨識技術判讀《貨郎圖》人物的情緒表現，帶領學生體會當時人物心情，感受宋代民間市井生活，同時培養學生藝術鑑賞的能力。</p>\n', 'techplan/plan/a8966ddf-a68b-45e9-9407-32cd74c34ae3.pdf', NULL, NULL, b'1', '【AI教案02】教案教學文件資料│貨郎來了有糖吃的小孩最幸福.pdf', NULL, NULL, 8, '2021-12-03 13:42:36', NULL, 0, 0, b'0'),
	(37, 2, '故宮文物猜猜看 - AI聊天機器人來出題', '國立中央大學-鐘祥仁、吳昌儒', 'X', 'K4-9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n透過與聊天機器人的對談，認識故宮館藏中極具代表性之歷史文物，並了解每件文物的年代、特徵以及相關背景，培養文物鑑賞之素養，提升學生學習動機。</p>\n', 'techplan/plan/bdf5a13a-6c0b-4abe-960e-c6399fccb41f.pdf', NULL, NULL, b'1', '【AI教案03】教案教學文件資料│故宮文物猜猜看.pdf', NULL, NULL, 10, '2021-12-03 14:30:09', NULL, 0, 0, b'0'),
	(38, 2, '跨越時空的仰望-micro:bit方位計算應用', '國立中央大學-鐘祥仁、吳昌儒', 'X', 'K6-9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n利用micro:bit的指南方向，學習如何從古地圖找到當今地名之相對位置，並從中發掘歷史地圖中古今地名改變與遷移的過程。</p>\n', 'techplan/plan/8693c740-66c5-4804-bfa0-701353dea0e8.pdf', NULL, NULL, b'1', '【AI教案04】教案教學文件資料│跨越時空的仰望.pdf', NULL, NULL, NULL, '2021-12-03 14:31:29', NULL, 0, 0, b'0'),
	(39, 2, '國寶總動員-視覺辨識寶盒', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K3-9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n透過AI視覺辨識帶領學生認識故宮國寶文物，並且在充分理解文物知識與內涵後，引導學生如何在文物認知與賞析基礎上建構在當代生活中的應用與連結。</p>\n', 'techplan/plan/c50fceca-b57a-4488-834c-2e670edef352.pdf', NULL, NULL, b'1', '【AI教案05】教案教學文件資料│國寶總動員.pdf', NULL, NULL, NULL, '2021-12-03 14:32:01', NULL, 0, 0, b'0'),
	(40, 3, '海怪圖記', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K4-12', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n認識《海怪圖記》的典故、用色、脈絡外，透過觀察及聯想，引導學生發想心中突發奇想的怪物，並透過羊毛氈創造屬於自己的海怪。</p>\n', 'techplan/plan/c3102626-669f-4e78-b67e-d15d05050e4d.pdf', NULL, NULL, b'1', '【STEAM教案01】教案教學文件資料│海怪圖記.pdf', NULL, NULL, NULL, '2021-12-03 14:33:25', NULL, 0, 0, b'0'),
	(41, 3, '指尖上的蝴蝶奇遇', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K3-6', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n透過故宮豐沛的書畫作品，感受古代書畫家在蝴蝶繪製上的藝術表現手法，藉由連桿與槓桿的機構原理，理解蝴蝶的構造與運動姿態，並創作連動蝴蝶作品。</p>\n', 'techplan/plan/c0708fa8-fca4-41d4-a2fb-67c5839a7dcb.pdf', NULL, NULL, b'1', '【STEAM教案02】教案教學文件資料│指尖上的蝴蝶奇遇.pdf', NULL, NULL, NULL, '2021-12-03 14:34:33', NULL, 0, 0, b'0'),
	(42, 3, '青銅器的幾何與紋飾-用剪紙紋飾說故事 ', '台北市立萬福國民小學-陳雨禾', 'X', 'K4-6', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n帶領學生欣賞青銅器紋飾之美，並運用數學幾何及對稱原理進行創作，將青銅紋飾加入學生的創意與巧思，設計成有故事的紋飾。</p>\n', 'techplan/plan/d98721b2-1cdc-4aa6-9e78-94bec46a0d1a.pdf', NULL, NULL, b'1', '【STEAM教案03】教案教學文件資料│青銅器的幾何與紋飾.pdf', NULL, NULL, NULL, '2021-12-03 14:35:10', NULL, 0, 0, b'0'),
	(43, 3, '昆蟲新潮流', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K2-6', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n認識故宮典藏的昆蟲相關書畫與文物，進而了解中西方昆蟲描繪手法的演進與相關象徵寓意，結合身體圖騰彩繪創作，讓昆蟲用另一種姿態展現在生活中。</p>\n', 'techplan/plan/752bb338-81b0-44a4-9dc3-eef3d1166973.pdf', NULL, NULL, b'1', '【STEAM教案04】教案教學文件資料│昆蟲新潮流.pdf', NULL, NULL, NULL, '2021-12-03 14:37:15', NULL, 0, 0, b'0'),
	(44, 3, '招財國寶動物-創意招財存錢筒', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K4-9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n認識故宮有吉祥寓意之文物，增加文化理解及審美與感知的素養，同時激發創作潛能，並透過STEAM實作收錢存錢筒，了解機電結構運作方式。</p>\n', 'techplan/plan/1829c0c6-06e8-4037-b1ac-6692149de9bf.pdf', NULL, NULL, b'1', '【STEAM教案05】教案教學文件資料│招財國寶動物.pdf', NULL, NULL, NULL, '2021-12-03 14:37:38', NULL, 0, 0, b'0'),
	(45, 1, '故宮動物與它的產地AR刮刮樂', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K7-12', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n藉由AR平台軟體結合故宮文物圖庫資料辨識，以及刮刮樂創作機制，讓學生充分理解古今動物的繪畫風格，並透過實作進行美感創作。</p>\n', 'techplan/plan/4f700479-60b1-4afd-aef9-7a90160c3acd.pdf', NULL, NULL, b'1', '【其它01】教案教學文件資料│故宮動物與它的產地AR刮刮樂.pdf', NULL, NULL, NULL, '2021-12-03 14:38:03', NULL, 0, 0, b'0'),
	(46, 1, '康雍硃批知道了', '桃園市立壽山高級中等學校-蘇健倫', 'X', 'K11', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n將皇帝奏摺結合情境與遊戲式學習，帶領學生體會清朝皇帝與大臣的應對歷程，並搭配「鷹架理論」以引導寫作的方式撰寫短文並學習圈注筆記。</p>\n', 'techplan/plan/1bda430f-be3f-499c-b8a0-394aa392c09c.pdf', NULL, NULL, b'1', '【其它02】教案教學文件資料│康雍硃批知道了.pdf', NULL, NULL, NULL, '2021-12-03 14:38:31', NULL, 0, 0, b'0'),
	(47, 1, '瓷器大時代AR桌遊', '臺北市立永春高級中學-曾慶良/李晉毅', 'X', 'K3-12', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n結合AR擴增實境及歷朝代瓷器的互動桌遊，讓學生從遊戲中認識陶瓷器的樣式、特色及製作方式，並培養賞析瓷器花飾藝術的能力。</p>\n', 'techplan/plan/94295d89-f81f-4ff8-914e-0cb3dfba9b75.pdf', NULL, NULL, b'1', '【其它03】教案教學文件資料│瓷器大時代AR桌遊 .pdf', NULL, NULL, NULL, '2021-12-03 14:39:05', NULL, 0, 0, b'0'),
	(48, 1, '家族記憶多寶盒', '台北市立萬福國民小學-陳雨禾', 'X', 'K5-6', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n以多寶格的排列配置及「古今中外，共聚一堂」的核心概念，進行家族記憶盒創作，透過蒐集家族回憶相關物件，創作屬於收藏溫暖記憶的寶盒。</p>\n', 'techplan/plan/51aac550-fb5b-474b-aee7-d4d1e831c98a.pdf', NULL, NULL, b'1', '【其它04】教案教學文件資料│家族記憶多寶盒.pdf', NULL, NULL, NULL, '2021-12-03 14:39:33', NULL, 0, 0, b'0'),
	(49, 1, '魚雁往返-信箋風情', '臺北市立大同高級中學-何敏華', 'X', 'K9-12', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n透過AR科技了解宋代砑花法的細緻與藝術性及宋代文人的書信文化，並透過數學詩創作，帶領學生以不同方式欣賞與體驗文物之美。</p>\n', 'techplan/plan/a3814cc1-9d2e-49d0-bb3c-b6c29a23f564.pdf', NULL, NULL, b'1', '【其它05】教案教學文件資料│魚雁往返-信箋風情.pdf', NULL, NULL, NULL, '2021-12-03 14:40:04', NULL, 0, 0, b'0'),
	(50, 1, '乾隆皇帝錦上添花的瑰麗密碼', '臺南嘉義聯隊-紀志聰/黃國斌/楊婷如', 'X', 'K7-12', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n結合數學、生活科技與藝術，介紹明、清掐絲琺瑯工藝之美與其中隱藏的數學原理，並體驗創作的樂趣。</p>\n', 'techplan/plan/f8bb4e96-ff83-426c-b4b0-be1dd5f4e537.pdf', 'techplan/sheet/dc8471d2-bda9-48e7-a844-0fcaeeef41c2.pdf', NULL, b'1', '【其它09】教案教學文件資料│乾隆皇帝錦上添花的瑰麗密碼.pdf', '【其它09】其它│學習單.pdf', NULL, NULL, '2021-12-03 14:40:33', NULL, 0, 0, b'0'),
	(51, 1, '翻轉地球：我的坤輿燈籠', '台北市立重慶國中-何緗翎/鄭旭恆/陳羿彣', 'X', 'K9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n以故宮《坤輿全圖》為主題，應用平面轉幾何的概念，將《坤輿全圖》以雷切雕刻機設計成組合模板，創造出獨一無二的坤輿燈籠。</p>\n', 'techplan/plan/ed2cb4a5-1f3f-42a9-a309-c210a6a73456.pdf', NULL, NULL, b'1', '【其它07】教案教學文件資料│翻轉地球：我的坤輿燈籠.pdf', NULL, NULL, NULL, '2021-12-03 14:41:17', NULL, 0, 0, b'0'),
	(52, 1, '玩香趣', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K7-12', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n透過故宮典藏之皇室香具，帶領學生了解古代工匠技巧與多變造型，並透過創意香具的製作並結合精油霧化器，將生活美學淬煉其中。</p>\n', 'techplan/plan/eb59a4f8-8a61-4006-8cfe-c376bec9a853.pdf', NULL, NULL, b'1', '【其它08】教案教學文件資料│玩香趣.pdf', NULL, NULL, NULL, '2021-12-03 14:41:50', NULL, 0, 0, b'0'),
	(53, 1, '帶著故宮環遊世界', '新北市立板橋高級中學新興科技推廣中心團隊', 'X', 'K4-12', NULL, 'X', '', 'techplan/plan/0ced2b1f-fc94-47d7-8e2e-43a4761dbbfb.pdf', NULL, NULL, b'1', '【其它10】教案教學文件資料│帶著故宮環遊世界.pdf', NULL, NULL, NULL, '2021-12-03 14:42:10', NULL, 0, 0, b'0'),
	(54, 1, '給你顏色瞧瞧', '蘇瑛慧/楊婷如​/林信廷', 'X', 'K5-9', NULL, 'X', '<p>\n<style type="text/css"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}-->\n</style>\n運用博物館史料，一窺唐宋妝容特色，進一步了解當時的美感及社會文化，並且透過科技載具，重現及體會唐代的妝容。</p>\n', 'techplan/plan/20289eaf-663f-4fad-a307-33838f9b3321.pdf', NULL, NULL, b'1', '【其它06】教案教學文件資料│給你顏色瞧瞧.pdf', NULL, NULL, 11, '2021-12-03 14:43:09', NULL, 0, 0, b'0'),
	(55, 3, '鳥語花香-飛鳥結構設計組裝', ' 台北市立麗山國民小學-蘇瑜琪老師 ', NULL, 'K5-12', NULL, '待更新', '<p>1. 了解國畫裡，特定圖像的相對文化意涵，感受畫家要傳達的想法，進而能欣賞畫作之美。</p>\n\n<p>2. 依據個人的想法，選用合適的故宮文物圖像，加入自己設計的圖案，來組裝具自動機凸輪結構的作品。</p>\n\n<p>3. 能展示作品，說明個人的創作想法。</p>\n', 'techplan/plan/f30aca54-6601-40ad-85e5-0a2b22b38ba6.pdf', NULL, NULL, b'1', 'STEAM教案07-鳥語花香.pdf', NULL, NULL, NULL, '2022-09-16 11:04:04', NULL, 0, 0, b'0'),
	(56, 1, '亞洲織品：現代織布機', '國立故宮博物院', NULL, 'K10-12', NULL, '無', '<p>本課程從學生的生活經驗出發，找出日常生活中的各式織品紋樣，並請學生去拓印日常生活中織品的紋樣。接著，連結到本次的展覽主題「亞洲織品展」，以「紋 樣」作為主軸，在展件中挑選各國的特色作品，讓學生去比較其紋樣差異。最後請學生運用「Scratch」積木式程式語言，運用程式製作「現代織布機」，學生可以改變程式碼參數與演算法，變化出各式各樣不同組織結構的數位織品。</p>\n', 'techplan/plan/2270c0dd-d86d-4f08-bbc5-e294d7baea24.zip', 'techplan/sheet/dd6f84e7-8ff6-481b-9237-59e615f91594.pdf', NULL, b'1', '「亞洲織品：現代織布機」教案與簡報.zip', '3_中文版「亞洲織品：現代織布機」學習單.pdf', NULL, NULL, '2022-10-06 14:08:57', NULL, 0, 0, b'0'),
	(57, 2, '跟著小翠穿越「清明上河圖」', '臺南市和順國中-林信廷', NULL, 'K3-12', NULL, '無', '<p><span style="font-size:11pt"><span style="text-justify:inter-ideograph"><span style="line-height:115%"><span style="font-family:Arial,sans-serif"><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">本教案是從「找威利」一書中得到靈感，希望藉由學生在尋找嵌入清明上河圖中的小翠時，同步仔細觀察清明上河圖中的人物、活動以及場景。過程中，除了更深入的了解文物的藝術價值以及背後的歷史知識之外，也能體驗到人工智慧為我們進行影像辨識時，所帶來的便利以及快速，並對於相關技術背後的原理有基本的認識，也知道這樣的技術在生活中有哪些應用。</span></span></span></span></span></span></span></span></p>\n', 'techplan/plan/f78d6197-5d69-4804-a4a3-48282f50f3d2.rar', NULL, NULL, b'1', '跟著小翠穿越清明上河圖.rar', NULL, NULL, 19, '2022-10-06 14:17:38', 'https://ipalace.npm.edu.tw/lesson/19', 0, 0, b'0'),
	(60, 3, '刻石取拓-我的黑老虎', ' 新北市立板橋高級中學新興科技推廣中心團隊', NULL, 'K4-12', NULL, '無', '<ol>\n	<li><span style="font-size:12pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">以故宮博物院南部院區</span></span></span><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:#0a0a0a">「刻石取拓─故宮碑帖特展」之策展主軸與延伸展品做為課程引</span></span></span><span style="line-height:115%"><span style="font-family:標楷體">導</span></span><span style="line-height:115%"><span style="font-family:標楷體">，同時利用教具模型，</span></span><span style="line-height:115%"><span style="font-family:標楷體">引<span style="color:#0a0a0a">導學生了解碑帖拓本作為一個古老的收藏類別及其文化意涵</span></span></span><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">。</span></span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">讓學生至校園探詢石碑、水溝蓋、銘碑等物件，並利用紙張、鉛筆嘗試拓印，體驗取拓的過程。</span></span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:#0a0a0a">引導學生創作圖案或文字，並透過</span></span></span><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">雕刻石膏板</span></span></span><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:#0a0a0a">，創作屬於自己的圖案拓片</span></span></span><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">。</span></span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="line-height:115%"><span style="font-family:Calibri,sans-serif"><span style="line-height:115%"><span style="font-family:標楷體"><span style="color:black">教授拓印技巧，讓學生將自己創作的拓片轉印到紙張、布料等材料上。</span></span></span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black">透過分享，與同學分享自己的拓印</span></span></span><span style="font-size:12.0pt"><span style="font-family:標楷體"><span style="color:#0a0a0a">創作</span></span></span></li>\n</ol>\n\n<p>&nbsp;</p>\n', 'techplan/plan/a56469e7-4c6c-4f3d-8c7b-81e3d6f05743.pdf', NULL, NULL, b'1', '刻石取拓-我的黑老虎-板中.pdf', NULL, NULL, 23, '2022-10-06 14:29:33', 'https://ipalace.npm.edu.tw/lesson/23', 0, 0, b'0'),
	(61, 2, '八段錦AI互動防疫健康操', '新北市立板橋高級中學新興科技推廣中心團隊', NULL, 'K4-12', NULL, '無', '<ol>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">藉由故宮博物院特展「壽而康」及「杏林春暖」，介紹故宮博物院鎮院典藏畫冊〈八段錦〉，原本收藏於清光緒帝瑾妃所居永和宮，提倡結合肢體動作和呼吸吐納的健體運動，了解其意義、動作、淵源等。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">依據〈八段錦〉的動作指引，並引導學生練習八段錦各個招式。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">介紹人工智慧領域及應用，及AI 視覺辨識原理及相關模組。本課程僅針對靜待姿勢進行訓練特徵，透過線上google teachable machine訓練及紀錄各種如故宮圖冊中的八段錦的定點靜態姿勢特徵，建立姿勢辨識系統並下載訓練結果。&nbsp;</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">介紹Scratch線上程式編輯網站，並匯入google teachable machine線上八段錦訓練結果，設計互動介面，完成八段錦姿勢識別之AI防疫健康操互動介面。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">由熟悉八段錦的教師或助教帶領學生練習八段錦，並由AI防疫健康操互動介面判斷定點靜態姿勢是否正確，系統給予相對應的回應以調整其姿勢，加強學生記憶八段錦各個招式，常此以往達到強身健體的效果，同時瞭解及學習中國既有傳統武學。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">與其他組別同學分享自己創作的互動介面，並練習及測試AI防疫健康操。</span></span></span></span></li>\n</ol>\n', 'techplan/plan/74842aad-0141-4f54-9c27-ba8048624057.pdf', NULL, NULL, b'1', '八段錦AI互動防疫健康操-板中.pdf', NULL, NULL, NULL, '2022-10-07 14:31:39', NULL, 0, 0, b'0'),
	(62, 3, '盤中悄然盛放-定窯', ' 新北市立板橋高級中學新興科技推廣中心團隊', NULL, 'K5-12', NULL, '無', '', 'techplan/plan/220fabbd-900f-4a9f-ae9f-e78b8f1aff81.pdf', NULL, NULL, b'1', 'STEAM教案--定窯.pdf', NULL, NULL, 20, '2022-10-07 14:35:46', 'https://ipalace.npm.edu.tw/lesson/20', 0, 0, b'0'),
	(63, 3, '藍曬國寶風景', '新北市立板橋高級中學新興科技推廣中心團隊', NULL, 'K4-12', NULL, '無', '<ol>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">以故宮博物院鎮院國寶〈萬壑松風〉、〈早春圖〉及〈谿山行旅〉為基底，讓學生了解這幾幅畫作的歷史背景、畫風、技術等文物知識。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">透過「繪晤山水」線上網站為引導，結合對國寶畫作的理解，及國畫上基本構圖原則說明，重組畫作各個部件，成為自己獨特畫作。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">利用藍曬技術將自己製作的山水畫作轉換為藍曬明信片。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">另外，讓學生至校園收集自然素材，作為藍曬圖的基本材料，另外創作一幅創意藍曬山水畫。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">透過分享，與同學分享自己創作的山水畫。</span></span></span></span></li>\n</ol>\n', 'techplan/plan/01b6ad06-6f28-4cbe-9fec-1ca7e13a50f0.pdf', NULL, NULL, b'1', '藍曬國寶風景-板中.pdf', NULL, NULL, 21, '2022-10-07 14:41:02', 'https://ipalace.npm.edu.tw/lesson/21', 0, 0, b'0'),
	(64, 3, '士拿乎的時尚風潮', '新北市立板橋高級中學新興科技推廣中心團隊', NULL, 'K4-12', NULL, '無', '<ol>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">以故宮博物院「士拿乎&mdash;清宮鼻煙壺的時尚風潮」之策展主軸與展品做為課程引導，初探各種材質之鼻煙壺，從雕刻、燒製、琢磨等工藝角度理解其製作及所呈現之時代特色，且以珍藏、日常到賞賜等不同目的，看到清代工藝之縮影，更是清宮微型藝術之精典。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">介紹鼻煙壺文物中常出現的圖案及樣態，讓學生創作屬於自己的圖案，並繪製於玻璃瓶上。</span></span></span></span></li>\n	<li><span style="font-size:12pt;"><span style="line-height:115%;"><span style="font-family:Calibri,sans-serif;"><span style="color:black;">透過分享，與同學分享自己的創作。</span></span></span></span></li>\n</ol>\n', 'techplan/plan/7d2b9115-e293-4022-a76c-721aa58c70d1.pdf', NULL, NULL, b'1', '士拿乎的時尚風潮-板中.pdf', NULL, NULL, 22, '2022-10-07 14:44:52', 'https://ipalace.npm.edu.tw/lesson/22', 0, 0, b'0'),
	(65, 3, '我的清明上盒', '台北市立麗山國小-蘇瑜琪', NULL, ' Ｋ5-12', NULL, '無', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-family:標楷體"><span style="color:black">COVID-19</span></span><span style="font-family:標楷體"><span style="color:black">疫情下線上教學成為學生的學習新型態，透過網路可即時搜尋到藝術品的相關資訊，也觀看到藝術品的細節，了解它的相關背景知識，藉著線上平台可與同學即時的討論問題。因此，即使是在實體的課程中，本課程的藝術欣賞、討論的部份，會藉由</span></span><span lang="EN-US" style="font-family:標楷體"><span style="color:black">padlet</span></span><span style="font-family:標楷體"><span style="color:black">線上平台上即時呈現藝術品細節(照片)與個人想法，來蒐集大家的看法。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:標楷體"><span style="color:black">理解</span></span><span style="font-family:標楷體"><span style="color:black">清明上河圖中所描繪當時人民食衣住行育樂各方面的生活型態，欣賞畫家筆墨的運用、色彩的配置，進一步能欣賞作品之美。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:標楷體"><span style="color:black">能發現個人與清明上河圖的共鳴處，取其中對自己有意義的部份，結合電路原理，來創作作品，讓學生能與清明上河圖有更深的聯結。</span></span></span></span></li>\n</ol>\n', 'techplan/plan/211888aa-39f3-4b4d-a471-8df509685ac3.pdf', NULL, NULL, b'1', '我的清明上盒-蘇瑜琪.pdf', NULL, NULL, NULL, '2022-10-07 14:57:33', NULL, 0, 0, b'0'),
	(66, 3, '點亮平安', '台北市立麗山國小-蘇瑜琪', NULL, 'Ｋ4-12', NULL, '無', '<ol>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:標楷體"><span style="color:black">在疫情快速攀高、人心感到不安的情景下，藉由認識故宮的珍藏「花瓶」，欣賞理解器物的特性與內涵的象徵意義，再引導學生進入創作，讓學生能感受到藝術帶來的平安與作品之美。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:標楷體"><span style="color:black">認識故宮珍藏「花瓶」(花器)的造型、質材、製作方法與紋飾的象徵意義。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:標楷體"><span style="color:black">運用「瓶」象徵「平安」的概念，將故宮的花瓶(花器)轉化成個人的作品，加上led燈設計，點亮平安，帶來光明希望。</span></span></span></span></li>\n	<li><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span style="font-family:標楷體"><span style="color:black">學生能表達自己對故宮珍藏「花器」的看法，並能說明自己的創作想法，藉由實際動手作，讓學生與故宮的珍藏有更深的連結。</span></span></span></span></li>\n</ol>\n', 'techplan/plan/8fef9101-c529-4e59-aa9b-74190f7a2496.pdf', NULL, NULL, b'1', '點亮平安-蘇瑜琪.pdf', NULL, NULL, NULL, '2022-10-07 15:01:19', NULL, 0, 0, b'0'),
	(68, 3, '山花舞蝶-平衡童玩教育遊具', '新北市立福營國中-蔡煜騰', NULL, 'K5-12', NULL, '無', '<p><span style="font-size:12pt"><span style="font-family:新細明體,serif"><span style="font-family:標楷體"><span style="color:black">本教案以故宮七月份即將登場的「草蟲天地」特展為核心結合童玩再創新為發想，透過引導，讓學員認識院藏草蟲的繪畫風格與技巧與蟲草在畫中的含意，並觀察畫卷中的昆蟲與植物種類與畫面的平衡。</span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:新細明體,serif">&nbsp;&nbsp;&nbsp;<span style="font-family:標楷體"><span style="color:black">在本次展覽中包含多種蝶蛾、蜻蜓等昆蟲，更有花卉奇石等。透過帶領學員學習畫中的技巧與典故，並將平面的畫作，利用剪紙與平衡遊具的製作方式，變成立體的呈現形式。</span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:新細明體,serif">&nbsp;&nbsp;&nbsp;<span style="font-family:標楷體"><span style="color:black">讓學員從中設計出心中的蝴蝶，並學習物理重心的原理，經過配重的實驗，找出最佳的平衡與平衡點，最終完成一個可平衡有色彩的創作。</span></span></span></span></p>\n', 'techplan/plan/dc73e2a1-1f57-4df2-84fc-49e3bf5ece6a.pdf', NULL, NULL, b'1', '山花舞蝶-平衡童玩教育遊具-蔡煜騰.pdf', NULL, NULL, 24, '2022-10-07 15:15:19', 'https://ipalace.npm.edu.tw/lesson/24', 0, 0, b'0'),
	(69, 3, '滿室飄香-茄楠配飾與生活芳香', '新北市立福營國中-蔡煜騰', NULL, 'K5-12', NULL, '無', '<p><span style="font-size:12pt"><span style="font-family:新細明體,serif"><span style="font-family:標楷體"><span style="color:black">香的使用在人類歷史中，相當久遠。從《聖經》中三博士的禮物，及至東方傳統的祭典，都有使用香的紀錄。</span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:新細明體,serif"><span style="font-family:標楷體"><span style="color:black">「茄楠」從明代開始便被視為最高等級的沉香只要一小片即能安神定魄滿室生香，有助於安定神魄，深受宮廷的喜愛，沉香的使用，在宮中十分興盛，從大型的擺件到各種做工精緻的佩飾、手串等，更因其珍貴就連創作後的邊料都會作成香囊或是研磨成粉末作為薰香使用。因此國立故宮博物院不僅收藏了大量的宮廷沉香雕件的頂級名品，更收藏者許多的品香用具。正因為茄楠材料如此珍貴，又是作為隨身物品的配飾再製作工藝與題材設計上必定充滿巧思與內涵。</span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:新細明體,serif"><span style="font-family:標楷體"><span style="color:black">本次教案選取了從「收藏陳設」、「隨身佩飾」、「品香香具」讓學生了解古人是如何使用這種價比金高的香中鑽石，讓生活更有味道。實作課程規畫將內容分為前端的模具製與成品製作兩個單元，進班教學時可因應不同年齡層的學生去作課程內容的調配與修增修。模具製作，包含電腦輔助製圖建模、3D列印、真空成形技術等部分，可作為8-12K科技素養的課程內容。成品製作，透過不同的模具成品結合樂土水泥製作成配飾造型擴香石，並結合不同造型的造型石膏模組，如蝙蝠、桃子、卐字等讓學生進行染色與排列發揮創意，過程不需要加熱，不必點火，安全節能又環保。</span></span></span></span></p>\n\n<p><span style="font-size:12pt"><span style="font-family:新細明體,serif"><span style="font-family:標楷體"><span style="color:black">完成擴香石作品後，透過不同的香味測試讓學生體驗到品香的樂趣，並說明毛細原理讓學生們瞭解擴香石的科學原理。</span></span></span></span></p>\n', 'techplan/plan/740a2463-f6f7-4c71-8416-204be113d8ce.pdf', NULL, NULL, b'1', '滿室飄香-茄楠配飾與生活芳香-蔡煜騰.pdf', NULL, NULL, NULL, '2022-10-07 15:20:18', NULL, 0, 0, b'0'),
	(70, 3, '福祿平安-葫蘆點點名', '新北市立福營國中-蔡煜騰', NULL, 'K5-12', NULL, '無', '<p class="Default"><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">葫蘆在華人文化中具有重要的意象與寓意，不論是在書畫或是器物都可以看到葫蘆的造型。</span></span></span></span><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">之所以重要是因為葫蘆本身有多重的吉祥象徵意義，其中包含了從讀音、植物特性到造型都有了不同的意涵。</span></span></span></span><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">如:葫蘆與「福祿」的諧音相同，以及它是一種綿延伸展的蔓藤植物</span></span></span></span><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">且葫蘆內藏有許多種籽而有了「多子多孫」、「長久不絕」的引寓，</span></span></span></span><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">葫蘆口小肚大可廣納四方財用以象徵財庫飽滿納財致福。</span></span></span></span></p>\n\n<p class="Default"><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">本次教案藉由院藏瓷器、漆器、玉器、金屬器、琺瑯器、玻璃器等各種類的葫蘆，說明葫蘆文化的人文意涵，透過多樣選材的瞭解院藏中葫蘆器形藏品的多樣性、套模葫蘆與葫蘆器的應用說明材質本身的可塑性與生活應用」並透過同題異材的型式，介紹常見的葫蘆創作主題如福祿大吉、多子多孫等。</span></span></span></span></p>\n\n<p class="Default"><span style="font-size:12pt"><span style="font-family:標楷體"><span style="color:black"><span style="color:black">實作中透過半開放性的立體卡片創作，學習華人文化中「借物傳情」的意涵，並在創作中嘗試將外形變化成自己喜歡的造型。</span></span></span></span></p>\n', 'techplan/plan/52d2cce8-9abb-4120-a4b2-5cddc9bc00f4.pdf', NULL, NULL, b'1', '福祿平安-葫蘆點點名-蔡煜騰.pdf', NULL, NULL, 25, '2022-10-07 15:25:11', 'https://ipalace.npm.edu.tw/techplan/70', 0, 0, b'0'),
	(71, 1, '佛陀形影：佛教藝術萬花筒', '國立故宮博物院', NULL, 'K7-9', NULL, '無', '<p>宗教藝術蘊含了許多過往⼈們的歷史與⽂化，同時也影響了東⻄⽅美術史中不同的宗教審美經驗累積。在本課程中，將以「佛教藝術美學」作為切入點，讓學⽣去分析與了解佛教藝術的各種形式展現，進⼀步能理解宗教藝術之美學從何⽽來。 接著，製作蘊含佛教藝術美學的濾鏡，⽤全新的⾓度去觀看與紀錄⽇常⽣活。將歷史與多種樣式的萬花筒搭建橋樑，讓學⽣運⽤⼯具來窺探歷史的美學記憶，連結藝術、歷史、科技與⾃⾝的⽣命經驗。</p>\n', 'techplan/plan/7bce6187-d1a0-47d8-a7ca-74995cc31953.zip', 'techplan/sheet/ed551a39-8864-4e60-ae3a-dc99d3dfc55f.pdf', NULL, b'1', '佛陀形影：佛教藝術萬花筒.zip', '3_中文版「佛陀形影：佛教藝術萬花筒」學習單.pdf', NULL, NULL, '2022-10-13 13:41:07', NULL, 0, 0, b'0'),
	(72, 1, '翰墨空間：演算式書畫藝術', '國立故宮博物院', NULL, 'K7-9', NULL, '無', '<p>「琴棋書畫」為古代的雅⼈四好，其中「書畫」佔了其中之⼆，然⽽對現代的中學⽣⽽⾔，學習或接觸⽑筆的機會已經相當缺乏，許多⼈接觸書畫的記憶都還停留在⼩時候的書法課。⽽隨著時代演進，科技的進步使得書畫⼯具產⽣不同的變⾰，現今的書畫⼯具已經漸漸數位化，學⽣們開始使⽤電腦、平板進⾏⽂字書寫、繪圖及創作。</p>\n\n<p>本課程將利⽤數位⼯具進⾏時代的融合，從線上作品的賞析比較到利⽤數位⼯作進⾏⽔墨風格的繪圖創作，讓學⽣去了解不同創作者作品的風格特⾊，並能以從AI數位創作體驗古典書畫風格，進⼀步了解⽔墨藝術的獨特性。</p>\n', 'techplan/plan/ebb5574e-e358-46c4-8fe1-85c7c7bc9e52.zip', 'techplan/sheet/28a3a4cf-8798-4f4f-8f72-c2979c0916bf.pdf', NULL, b'1', '「翰墨空間：演算式書畫藝術」.zip', '3_中文版「翰墨空間：演算式書畫藝術」學習單.pdf', NULL, NULL, '2022-10-13 13:47:52', NULL, 0, 0, b'0'),
	(73, 1, '東亞茶⽂化：穿越時空的茶器', '國立故宮博物院', NULL, 'K10-12', NULL, '無', '<p>茶之於華⼈⽂化中，是非常重要的存在，不僅⽌於茶葉本⾝的好喝程度，也代表著⽣活的美學與態度，衍伸之茶碗、茶壺、茶杯等茶器，皆因⽂化不同發展出相異的形狀。</p>\n\n<p>此堂課從現代中學⽣所熟知的「⼿搖茶」為出發點，從現代⼿搖茶飲作為發展的基礎，依據所選中主題，設計⼀套古今融合的茶器，藉此了解其背後的⽂化意涵。</p>\n', 'techplan/plan/74b115e2-0c23-477e-80fe-33d86b569bc8.zip', 'techplan/sheet/f46d9ee3-f29e-475d-ba60-92534de7a721.pdf', NULL, b'1', '「東亞茶文化：穿越時空的茶器」.zip', '3_中文版「東亞茶文化：穿越時空的茶器」學習單.pdf', NULL, NULL, '2022-10-13 14:02:52', NULL, 0, 0, b'0'),
	(74, 1, '人氣國寶：國寶動畫故事館', '國立故宮博物院', NULL, 'K10-12', NULL, '無', '<p>國寶的定義為國家極珍貴的事物或極卓越的⼈才，在「⼈氣國寶展」，便展⽰了故宮所蒐藏古代⽂物之經典性，每個珍藏奇物背後都有故事，⽽這樣的故事，遷移轉譯了當時的歷史、⽂化、⽣活等等。</p>\n\n<p>本課程以國寶為主題，期待中學⽣將所接收的國寶故事，轉譯為定格動畫影像，期待學⽣能在轉譯的過程中，更加了解⽂物珍貴之處。</p>\n', 'techplan/plan/d33a324f-a821-44bf-89ac-745278d54ea9.zip', 'techplan/sheet/ea1d6fa6-8ea3-4ee0-ab7b-565272a82e4a.pdf', NULL, b'1', '「人氣國寶：國寶動畫故事館」.zip', '3_中文版「人氣國寶：國寶動畫故事館」學習單.pdf', NULL, NULL, '2022-10-13 14:07:11', NULL, 0, 0, b'0'),
	(75, 2, '我「行」我「溯」---AI讀行書', '臺北市立大同高中-何敏華', NULL, 'K7-12', NULL, ' ', '<p>1. 了解漢字篆書、隸書、楷書、草書的發展與字體特色。<br />\n2. 了解如何欣賞書法，並在點畫、結字、運筆與行氣的欣賞原則中，體會書法獨特的文化與藝術涵養。</p>\n\n<p>3. AI的體驗學習: 體驗、使用Teachable Machine在圖像辨識的模型訓練，讓學生認識 AI 人工智慧的神經網路應用。</p>\n\n<p>4. 結合國語文與科技資訊，進行跨領域探索，探索書法的書寫特色與機器學習中影像特徵萃取演算法的結合。</p>\n', 'techplan/plan/2b0b14cb-4d68-4390-b652-243192e804da.pdf', NULL, NULL, b'1', '我「行」我「溯」---AI讀行書.pdf', NULL, NULL, NULL, '2022-11-17 16:46:45', NULL, 0, 0, b'0'),
	(76, 1, '兒戲古今', '桃園市山豐國小-劉宛純', NULL, 'K5-6', NULL, ' ', '<p>帶領學生蒐集資料、繪畫創作、設計謎題，以遊戲式學習概念設計「兒戲古今」解謎遊戲。本教案以「兒戲古今」運用於課堂，結合AR技術與道具解謎包，讓參與者於情境遊戲活動中認識文物。</p>\n', 'techplan/plan/0951cbe9-4427-441b-8835-a3fca446b6d4.pdf', NULL, NULL, b'1', '兒戲古今-劉宛純-桃園市山豐國小.pdf', NULL, NULL, NULL, '2022-11-17 16:49:40', NULL, 0, 0, b'0'),
	(77, 3, '鳩伙來較車－鳩車動能的猜想', '新北市明志國小-黄雅茹', NULL, 'K3-6', NULL, ' ', '<p style="border:none; text-align:justify"><span style="font-size:11pt"><span style="text-justify:inter-ideograph"><span style="line-height:normal"><span style="font-family:&quot;Arial Unicode MS&quot;,sans-serif"><span style="color:black"><span style="font-size:12.0pt"><span style="font-family:KaiTi">現代孩子有「火柴盒小汽車」的玩具收藏來表達對「汽車」的喜愛和執著，古代則有「五歲鳩車之樂」來對應「馬車」</span></span></span></span></span></span></span><span style="font-size:12.0pt"><span style="line-height:115%"><span style="font-family:KaiTi"><span style="color:black">歡喜之情。透過如何做一台自己手做的鳩車，一台會動的鳩車，最後舉行「較車」來進行鳩車性能的比賽。過程中結合自然科學領域對「橡皮筋動力車」的製作，來完成一台會動的鳩車，從中探討「簡單機械之輪軸」與「橡皮筋動力車原理」以及「鳩尾」產生的「車體配重問題」，透過種種發現問題和解決問題的過程來激發孩子的科學與美感素養，讓孩子習得許多精細動作的能力、帶著走的能力。</span></span></span></span></p>\n', 'techplan/plan/dfe61fa6-7f22-4333-8eb4-f8655e5a2b98.pdf', NULL, NULL, b'1', '鳩伙來較車－鳩車動能的猜想-黄雅茹-新北市明志國小.pdf', NULL, NULL, NULL, '2022-11-17 16:58:46', NULL, 0, 0, b'0'),
	(78, 3, '草蟲夜趣', '台北市麗山國小-施靜華 蘇瑜琪', NULL, 'K4-6', NULL, ' ', '<p>1. 藉由觀察野地花草間的昆蟲及小生物，欣賞精巧可愛的形體及生動活潑的姿態，讓孩子更加親近大自然。<br />\n2. 從故宮畫作裡的花草中找出的小昆蟲，認識牠們的真實身分，貼近生活經驗，並進而提升想了解畫作所要傳達的意念，拉近與故宮文物之間的距離。<br />\n3. 了解花草的特徵及昆蟲的習性，理解草蟲畫家對棲息地的描繪，認識到畫中的小生物們努力展現的生命力。<br />\n4. 觀察草蟲畫家對不同昆蟲、植物描繪的寫實程度，並透過植物藍晒課程，體驗並觀察及描繪花草間小生物，享受創作的樂趣及成就感。</p>\n', 'techplan/plan/0f41cf68-db62-4984-98e5-93428ced1dde.pdf', NULL, NULL, b'1', '草蟲夜趣-施靜華蘇瑜琪-台北市麗山國小-修正.pdf', NULL, NULL, NULL, '2022-11-17 17:00:37', NULL, 0, 0, b'0'),
	(79, 3, '蝶蝶稱奇', '臺北市陽明高中國中部-楊宗翰/呂佳穎/ 徐嘉靖/范美如/ 江崇宇/ 李皓翔', NULL, 'K7', NULL, ' ', '<p>透過「清余省百蝶圖」引起動機，圖上百蝶是否真的有百蝶？百蝶是怎麼計算出來的？如何更快的計算出百蝶？現實生活中如何去計算生物族群的數量？蝴蝶的色彩象徵什麼意思？如何去重新詮釋你自己的百蝶？百蝶手機座如何可以適用不同手機與不同角度？手機座有辦法像蝴蝶一樣輕巧好攜帶？<br />\n這是一個跨領域的教學教案，從數數看「清余省百蝶圖」是否真的有100隻蝴蝶開始，引起學生動機，接著透過不同科目一起圍繞著「清余省百蝶圖」展開一場跨領域的蝴蝶教學。</p>\n', 'techplan/plan/34f77de1-2201-4ae7-a84c-e376ea28ec0b.pdf', NULL, NULL, b'1', '蝶蝶稱奇-楊宗翰-台北市陽明高中國中部.pdf', NULL, NULL, NULL, '2022-11-17 17:02:18', '00', 0, 0, b'0'),
	(80, 3, '霜樣景泰藍', '新北市板橋高中-李瑞婷', NULL, 'K11-12', NULL, ' ', '<p>引導學生欣賞謎樣景泰藍特展的文物，認識景泰藍的歷史背景，了解琺瑯工藝的基本方法，運用生活可取得的食材，了解食材生化特性後，體驗掐絲琺瑯的製作流程。</p>\n', 'techplan/plan/fdf8728f-814f-4f32-b36e-0598361d578c.pdf', NULL, NULL, b'1', '霜樣景泰藍-李瑞婷-新北市板橋高中.pdf', NULL, NULL, NULL, '2022-11-17 17:03:27', NULL, 0, 0, b'0'),
	(81, 3, '一日乾隆皇帝花藝師', '基隆商工-張曉菁、松山家商-張美雀', NULL, 'K9-12', NULL, ' ', '<p>1. 透過三希堂的佈置，觀察乾隆皇帝書房的佈置。並古今對照自己書房的佈置。<br />\n2. 藉由不同材質及裝飾的壁瓶，能分類壁瓶的種類。<br />\n3. 透過故宮壁瓶的欣賞，並閱讀相關文獻後，進行文物仿作，創作自己的壁瓶。<br />\n4. 介紹掐絲琺瑯工藝的源由。<br />\n5. 認識現代生活常見的乾燥花與不凋花。<br />\n6. 透過AI語音辨識與晶片的整合，提供各種藝術推廣的無障礙服務。<br />\n7. 結合科技及語言晶片，讓壁瓶增添不同功能。<br />\n8. 創作完成的壁瓶，除了是藝術品之外，還能當作什麼樣的生活用品呢？例如：冰箱磁鐵。</p>\n', 'techplan/plan/30cdfbcb-e2ba-4a06-a800-d1ca59edc1f9.pdf', NULL, NULL, b'1', '一日乾隆皇帝花藝師-張曉菁張美雀-基隆商工、松山家商.pdf', NULL, NULL, NULL, '2022-11-17 17:05:16', NULL, 0, 0, b'0'),
	(82, 3, 'Fun玩景泰藍', '台北市麗山國小-蘇瑜琪', NULL, 'K5-6', NULL, ' ', '<p>1.了解波斯文化對中國景泰藍文物的影響，認識景泰藍文物的特色與歷史，能知道景泰藍的材料特性，理解其製作方式與流程，感受匠人製作景泰藍的嚴謹態度，提升學生對景泰藍文物的欣賞。<br />\n2.景泰藍文物製作精美，需經過多道的程序與時間，經高溫燒製，方能完成作品。在教育現場並無相關的設備與足夠的時間來讓學生製作真正的景泰藍作品。因此，以較易取得的材料，來讓學生進行「仿掐絲琺瑯」的創作，實際體會匠人的職人精神，以及作品完成時的成就感。<br />\n3.在平板上運用padlet 雲端分享工具網站舉辦線上拍賣會。讓學生分享作品創作照片，並以文字、錄音或錄影的方式來說明創作想法。同時，也能即時給予同學作品回饋，欣賞大家的創作。</p>\n', 'techplan/plan/efeb23e8-d693-4009-a0af-2488699acaf0.pdf', NULL, NULL, b'1', 'Fun玩景泰藍-蘇瑜琪-台北市麗山國小－修正.pdf', NULL, NULL, NULL, '2022-11-17 17:07:52', NULL, 0, 0, b'0'),
	(83, 3, '穿越時空_ㄩˋ獻您!', '臺東新生國小-陳怡蒨、紅葉國小-林晏如', NULL, 'K5-6', NULL, ' ', '<p>本教學旨在培養學生『文物』 之於『我』之於『生活』」之價值觀，讓學生透過感受、想像、實踐和分享等階段探索學習。</p>\n\n<p>分別設計「相ㄩˋ我有感!」、「ㄩˋ於言表」及「ㄩˋ見祝福」三個活動。先以「玩」的概念開端，營造開放、有趣的學習情境，再應用藝術與數位科技結合，初探並認識古玉的文化內涵，最後再注入個人的創意發想，讓文物融入生活、貼近自身，從中培養批判思考、創意發想及問題解決能力。</p>\n\n<p>故課程規劃由多元具象的感官探索出發，藉此喚起人對於文物美的經驗、想像與好奇，再藉由故宮典藏及台東史前文化博物館等資料搜尋，理解從古至今人們對「玉」重視及內隱於心的想像與祝福，最後在賦予創作意義的同時， 也為自己注入新的生命動能。</p>\n\n<p>因此&lt;穿越時空&gt;系列課程，除了希望學習者能跨越時空距離與文物相遇，也期盼典藏文物更接近人心，更冀望所有課程參與者，持續共創美善。</p>\n', 'techplan/plan/54d20b43-4534-4870-86e2-45f0eb43b241.pdf', NULL, NULL, b'1', '穿越時空_ㄩˋ獻您!-陳怡蒨林晏如-臺東新生國小、紅葉國小.pdf', NULL, NULL, NULL, '2022-11-17 17:10:27', NULL, 0, 0, b'0'),
	(84, 3, '景泰藍居家餐盤設計有限公司', '高雄女中-黃怡茹', NULL, 'K10-12', NULL, ' ', '<p>期望透由本次教學，讓學生主動觀察故宮〈謎樣景泰藍〉之掐絲琺瑯，深入比較、分析、應用及運用此藝術知能，並將此觀察及鑑賞能力，落實於日常生活中。</p>\n\n<p>整體教學流程以「故宮考古研究室」情境引導，訓練學生的主動性、觀察力、執行力，藉由研發小組的團隊合作，讓學生針對掐絲琺瑯之花紋、色彩、掐絲手法，設計一款現代餐盤組，將掐絲琺瑯之美帶入現代日常生活中。過程中適時使用平板裝置，以利快速查詢故宮線上資源，最後扣合科技教育，將成果發表與GOXR虛擬空間結合，企圖嘗試多元化學習評量。</p>\n', 'techplan/plan/03a8aec8-a615-4a4a-a374-6f8df53d4d72.pdf', NULL, NULL, b'1', '景泰藍居家餐盤設計有限公司-黃怡茹-高雄女中.pdf', NULL, NULL, NULL, '2022-11-17 17:18:43', NULL, 0, 0, b'0'),
